INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(1, 'bulbasaur', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/1.png', 'A strange seed was planted on its back at birth. The plant sprouts and grows with this POKéMON.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(2, 'ivysaur', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/2.png', 'When the bulb on its back grows large, it appears to lose the ability to stand on its hind legs.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(3, 'venusaur', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/3.png', 'The plant blooms when it is absorbing solar energy. It stays on the move to seek sunlight.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(4, 'charmander', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/4.png', 'Obviously prefers hot places. When it rains, steam is said to spout from the tip of its tail.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(5, 'charmeleon', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/5.png', 'When it swings its burning tail, it elevates the temperature to unbearably high levels.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(6, 'charizard', 'fire', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/6.png', 'Spits fire that is hot enough to melt boulders. Known to cause forest fires unintentionally.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(7, 'squirtle', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/7.png', 'After birth, its back swells and hardens into a shell. Powerfully sprays foam from its mouth.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(8, 'wartortle', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/8.png', 'Often hides in water to stalk unwary prey. For swimming fast, it moves its ears to maintain balance.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(9, 'blastoise', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/9.png', 'A brutal POKéMON with pressurized water jets on its shell. They are used for high speed tackles.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(10, 'caterpie', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/10.png', 'Its short feet are tipped with suction pads that enable it to tirelessly climb slopes and walls.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(11, 'metapod', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/11.png', 'This POKéMON is vulnerable to attack while its shell is soft, exposing its weak and tender body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(12, 'butterfree', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/12.png', 'In battle, it flaps its wings at high speed to release highly toxic dust into the air.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(13, 'weedle', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/13.png', 'Often found in forests, eating leaves. It has a sharp venomous stinger on its head.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(14, 'kakuna', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/14.png', 'Almost incapable of moving, this POKéMON can only harden its shell to protect itself from predators.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(15, 'beedrill', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/15.png', 'It has three poisonous stingers on its forelegs and its tail. They are used to jab its enemy repeatedly.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(16, 'pidgey', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/16.png', 'A common sight in forests and woods. It flaps its wings at ground level to kick up blinding sand.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(17, 'pidgeotto', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/17.png', 'Very protective of its sprawling territorial area, this POKéMON will fiercely peck at any intruder.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(18, 'pidgeot', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/18.png', 'When hunting, it skims the surface of water at high speed to pick off unwary prey such as MAGIKARP.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(19, 'rattata', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/19.png', 'Bites anything when it attacks. Small and very quick, it is a common sight in many places.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(20, 'raticate', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/20.png', 'It uses its whis­ kers to maintain its balance. It apparently slows down if they are cut off.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(21, 'spearow', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/21.png', 'It flaps its small wings busily to fly. Using its beak, it searches in grass for prey.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(22, 'fearow', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/22.png', 'With its huge and magnificent wings, it can keep aloft without ever having to land for rest.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(23, 'ekans', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/23.png', 'Moves silently and stealthily. Eats the eggs of birds, such as PIDGEY and SPEAROW, whole.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(24, 'arbok', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/24.png', 'It is rumored that the ferocious warning markings on its belly differ from area to area.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(25, 'pikachu', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/25.png', 'When several of these POKéMON gather, their electricity could build and cause lightning storms.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(26, 'raichu', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/26.png', 'Its long tail serves as a ground to protect itself from its own high voltage power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(27, 'sandshrew', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/27.png', 'Burrows deep underground in arid locations far from water. It only emerges to hunt for food.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(28, 'sandslash', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/28.png', 'Curls up into a spiny ball when threatened. It can roll while curled up to attack or escape.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(29, 'nidoran-f', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/29.png', 'Although small, its venomous barbs render this POKéMON dangerous. The female has smaller horns.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(30, 'nidorina', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/30.png', 'The female\'s horn develops slowly. Prefers physical attacks such as clawing and biting.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(31, 'nidoqueen', 'poison', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/31.png', 'Its hard scales provide strong protection. It uses its hefty bulk to execute powerful moves.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(32, 'nidoran-m', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/32.png', 'Stiffens its ears to sense danger. The larger its horns, the more powerful its secreted venom.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(33, 'nidorino', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/33.png', 'An aggressive POKéMON that is quick to attack. The horn on its head secretes a powerful venom.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(34, 'nidoking', 'poison', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/34.png', 'It uses its powerful tail in battle to smash, constrict, then break the prey\'s bones.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(35, 'clefairy', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/35.png', 'Its magical and cute appeal has many admirers. It is rare and found only in certain areas.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(36, 'clefable', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/36.png', 'A timid fairy POKéMON that is rarely seen. It will run and hide the moment it senses people.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(37, 'vulpix', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/37.png', 'At the time of birth, it has just one tail. The tail splits from its tip as it grows older.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(38, 'ninetales', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/38.png', 'Very smart and very vengeful. Grabbing one of its many tails could result in a 1000-year curse.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(39, 'jigglypuff', 'normal', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/39.png', 'When its huge eyes light up, it sings a mysteriously soothing melody that lulls its enemies to sleep.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(40, 'wigglytuff', 'normal', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/40.png', 'The body is soft and rubbery. When angered, it will suck in air and inflate itself to an enormous size.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(41, 'zubat', 'poison', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/41.png', 'Forms colonies in perpetually dark places. Uses ultrasonic waves to identify and approach targets.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(42, 'golbat', 'poison', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/42.png', 'Once it strikes, it will not stop draining energy from the victim even if it gets too heavy to fly.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(43, 'oddish', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/43.png', 'During the day, it stays in the cold underground to avoid the sun. It grows by bath­ ing in moonlight.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(44, 'gloom', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/44.png', 'What appears to be drool is actually sweet honey. It is very sticky and clings stubbornly if touched.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(45, 'vileplume', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/45.png', 'The larger its petals, the more toxic pollen it contains. Its big head is heavy and hard to hold up.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(46, 'paras', 'bug', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/46.png', 'Burrows to suck tree roots. The mushrooms on its back grow by draw­ ing nutrients from the bug host.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(47, 'parasect', 'bug', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/47.png', 'A host-parasite pair in which the parasite mushroom has taken over the host bug. Prefers damp places.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(48, 'venonat', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/48.png', 'Lives in the shadows of tall trees where it eats insects. It is attracted by light at night.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(49, 'venomoth', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/49.png', 'The dust-like scales covering its wings are color coded to indicate the kinds of poison it has.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(50, 'diglett', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/50.png', 'Lives about one yard underground where it feeds on plant roots. It sometimes appears above ground.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(51, 'dugtrio', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/51.png', 'A team of DIGLETT triplets. It triggers huge earthquakes by burrowing 60 miles underground.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(52, 'meowth', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/52.png', 'Adores circular objects. Wanders the streets on a nightly basis to look for dropped loose change.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(53, 'persian', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/53.png', 'Although its fur has many admirers, it is tough to raise as a pet because of its fickle meanness.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(54, 'psyduck', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/54.png', 'While lulling its enemies with its vacant look, this wily POKéMON will use psychokinetic powers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(55, 'golduck', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/55.png', 'Often seen swim­ ming elegantly by lake shores. It is often mistaken for the Japanese monster, Kappa.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(56, 'mankey', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/56.png', 'Extremely quick to anger. It could be docile one moment then thrashing away the next instant.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(57, 'primeape', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/57.png', 'Always furious and tenacious to boot. It will not abandon chasing its quarry until it is caught.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(58, 'growlithe', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/58.png', 'Very protective of its territory. It will bark and bite to repel intruders from its space.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(59, 'arcanine', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/59.png', 'A POKéMON that has been admired since the past for its beauty. It runs agilely as if on wings.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(60, 'poliwag', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/60.png', 'Its newly grown legs prevent it from running. It appears to prefer swimming than trying to stand.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(61, 'poliwhirl', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/61.png', 'Capable of living in or out of water. When out of water, it sweats to keep its body slimy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(62, 'poliwrath', 'water', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/62.png', 'An adept swimmer at both the front crawl and breast stroke. Easily overtakes the best human swimmers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(63, 'abra', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/63.png', 'Using its ability to read minds, it will identify impending danger and TELEPORT to safety.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(64, 'kadabra', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/64.png', 'It emits special alpha waves from its body that induce headaches just by being close by.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(65, 'alakazam', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/65.png', 'Its brain can out­ perform a super­ computer. Its intelligence quotient is said to be 5,000.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(66, 'machop', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/66.png', 'Loves to build its muscles. It trains in all styles of martial arts to become even stronger.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(67, 'machoke', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/67.png', 'Its muscular body is so powerful, it must wear a power save belt to be able to regulate its motions.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(68, 'machamp', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/68.png', 'Using its heavy muscles, it throws powerful punches that can send the victim clear over the horizon.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(69, 'bellsprout', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/69.png', 'It prefers hot and humid environments. It is quick at capturing prey with its vines.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(70, 'weepinbell', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/70.png', 'It spits out POISONPOWDER to immobilize the enemy and then finishes it with a spray of ACID.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(71, 'victreebel', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/71.png', 'Said to live in huge colonies deep in jungles, although no one has ever returned from there.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(72, 'tentacool', 'water', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/72.png', 'Drifts in shallow seas. Anglers who hook them by accident are often punished by its stinging acid.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(73, 'tentacruel', 'water', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/73.png', 'The tentacles are normally kept short. On hunts, they are extended to ensnare and immobilize prey.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(74, 'geodude', 'rock', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/74.png', 'Found in fields and mountains. Mistaking them for boulders, people often step or trip on them.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(75, 'graveler', 'rock', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/75.png', 'Rolls down slopes to move. It rolls over any obstacle without slowing or changing its direction.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(76, 'golem', 'rock', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/76.png', 'Its boulder-like body is extremely hard. It can easily withstand dynamite blasts without damage.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(77, 'ponyta', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/77.png', 'As a newborn, it can barely stand. However, through galloping, its legs are made tougher and faster.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(78, 'rapidash', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/78.png', 'Very competitive, this POKéMON will chase anything that moves fast in the hopes of racing it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(79, 'slowpoke', 'water', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/79.png', 'Incredibly slow and dopey. It takes 5 seconds for it to feel pain when under attack.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(80, 'slowbro', 'water', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/80.png', 'The SHELLDER that is latched onto SLOWPOKE\'s tail is said to feed on the host\'s left over scraps.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(81, 'magnemite', 'electric', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/81.png', 'Uses anti-gravity to stay suspended. Appears without warning and uses THUNDER WAVE and similar moves.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(82, 'magneton', 'electric', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/82.png', 'Formed by several MAGNEMITEs linked together. They frequently appear when sunspots flare up.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(83, 'farfetchd', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/83.png', 'The sprig of green onions it holds is its weapon. It is used much like a metal sword.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(84, 'doduo', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/84.png', 'A bird that makes up for its poor flying with its fast foot speed. Leaves giant footprints.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(85, 'dodrio', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/85.png', 'Uses its three brains to execute complex plans. While two heads sleep, one head stays awake.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(86, 'seel', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/86.png', 'The protruding horn on its head is very hard. It is used for bashing through thick ice.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(87, 'dewgong', 'water', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/87.png', 'Stores thermal energy in its body. Swims at a steady 8 knots even in intensely cold waters.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(88, 'grimer', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/88.png', 'Appears in filthy areas. Thrives by sucking up polluted sludge that is pumped out of factories.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(89, 'muk', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/89.png', 'Thickly covered with a filthy, vile sludge. It is so toxic, even its footprints contain poison.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(90, 'shellder', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/90.png', 'Its hard shell repels any kind of attack. It is vulnerable only when its shell is open.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(91, 'cloyster', 'water', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/91.png', 'When attacked, it launches its horns in quick volleys. Its innards have never been seen.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(92, 'gastly', 'ghost', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/92.png', 'Almost invisible, this gaseous POKéMON cloaks the target and puts it to sleep without notice.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(93, 'haunter', 'ghost', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/93.png', 'Because of its ability to slip through block walls, it is said to be from an­ other dimension.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(94, 'gengar', 'ghost', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/94.png', 'Under a full moon, this POKéMON likes to mimic the shadows of people and laugh at their fright.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(95, 'onix', 'rock', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/95.png', 'Opening its large mouth, it ingests massive amounts of soil and creates long tunnels.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(96, 'drowzee', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/96.png', 'Puts enemies to sleep then eats their dreams. Occasionally gets sick from eating bad dreams.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(97, 'hypno', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/97.png', 'When it locks eyes with an enemy, it will use a mix of PSI moves such as HYPNOSIS and CONFUSION.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(98, 'krabby', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/98.png', 'Its pincers are not only powerful weapons, they are used for balance when walking sideways.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(99, 'kingler', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/99.png', 'The large pincer has 10000 hp of crushing power. However, its huge size makes it unwieldy to use.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(100, 'voltorb', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/100.png', 'Usually found in power plants. Easily mistaken for a POKé BALL, they have zapped many people.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(101, 'electrode', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/101.png', 'It stores electric energy under very high pressure. It often explodes with little or no provocation.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(102, 'exeggcute', 'grass', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/102.png', 'Using telepathy only they can employ, they always form a cluster of six EXEGGCUTE.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(103, 'exeggutor', 'grass', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/103.png', 'Legend has it that on rare occasions, one of its heads will drop off and continue on as an EXEGGCUTE.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(104, 'cubone', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/104.png', 'Because it never removes its skull helmet, no one has ever seen this POKéMON\'s real face.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(105, 'marowak', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/105.png', 'The bone it holds is its key weapon. It throws the bone skillfully like a boomerang to KO targets.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(106, 'hitmonlee', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/106.png', 'When in a hurry, its legs lengthen progressively. It runs smoothly with extra long, loping strides.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(107, 'hitmonchan', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/107.png', 'While apparently doing nothing, it fires punches in lightning fast volleys that are impossible to see.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(108, 'lickitung', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/108.png', 'Its tongue can be extended like a chameleon\'s. It leaves a tingling sensation when it licks enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(109, 'koffing', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/109.png', 'If one gets close enough to it when it expels poison­ ous gas, the gas swirling inside it can be seen.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(110, 'weezing', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/110.png', 'If one of the twin KOFFING inflates, the other one deflates. It con­ stantly mixes its poisonous gases.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(111, 'rhyhorn', 'ground', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/111.png', 'A POKéMON with a one-track mind. Once it charges,  it won\'t stop running until it falls asleep.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(112, 'rhydon', 'ground', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/112.png', 'Protected by an armor-like hide, it is capable of living in molten lava of 3,600 degrees.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(113, 'chansey', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/113.png', 'A rare and elusive POKéMON that is said to bring happiness to those who manage to get it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(114, 'tangela', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/114.png', 'The whole body is swathed with wide vines that are similar to sea­ weed. Its vines shake as it walks.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(115, 'kangaskhan', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/115.png', 'The infant rarely ventures out of its mother\'s protective pouch until it is 3 years old.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(116, 'horsea', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/116.png', 'Known to shoot down flying bugs with precision blasts of ink from the surface of the water.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(117, 'seadra', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/117.png', 'Capable of swim­ ming backwards by rapidly flapping its wing-like pectoral fins and stout tail.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(118, 'goldeen', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/118.png', 'Its tail fin billows like an elegant ballroom dress, giving it the nickname of the Water Queen.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(119, 'seaking', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/119.png', 'In the autumn spawning season, they can be seen swimming power­ fully up rivers and creeks.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(120, 'staryu', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/120.png', 'An enigmatic POKéMON that can effortlessly regenerate any appendage it loses in battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(121, 'starmie', 'water', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/121.png', 'Its central core glows with the seven colors of the rainbow. Some people value the core as a gem.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(122, 'mr-mime', 'psychic', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/122.png', 'If interrupted while it is miming, it will slap around the offender with its broad hands.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(123, 'scyther', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/123.png', 'With ninja-like agility and speed, it can create the illusion that there is more than one.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(124, 'jynx', 'ice', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/124.png', 'It seductively wiggles its hips as it walks. It can cause people to dance in unison with it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(125, 'electabuzz', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/125.png', 'Normally found near power plants, they can wander away and cause major blackouts in cities.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(126, 'magmar', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/126.png', 'Its body always burns with an orange glow that enables it to hide perfectly among flames.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(127, 'pinsir', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/127.png', 'If it fails to crush the victim in its pincers, it will swing it around and toss it hard.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(128, 'tauros', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/128.png', 'When it targets an enemy, it charges furiously while whipping its body with its long tails.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(129, 'magikarp', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/129.png', 'In the distant past, it was somewhat stronger than the horribly weak descendants that exist today.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(130, 'gyarados', 'water', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/130.png', 'Rarely seen in the wild. Huge and vicious, it is capable of destroying entire cities in a rage.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(131, 'lapras', 'water', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/131.png', 'A POKéMON that has been over­ hunted almost to extinction. It can ferry people across the water.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(132, 'ditto', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/132.png', 'Capable of copying an enemy\'s genetic code to instantly transform itself into a duplicate of the enemy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(133, 'eevee', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/133.png', 'Its genetic code is irregular. It may mutate if it is exposed to radiation from element STONEs.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(134, 'vaporeon', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/134.png', 'Lives close to water. Its long tail is ridged with a fin which is often mistaken for a mermaid\'s.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(135, 'jolteon', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/135.png', 'It accumulates negative ions in the atmosphere to blast out 10000- volt lightning bolts.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(136, 'flareon', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/136.png', 'When storing thermal energy in its body, its temperature could soar to over 1600 degrees.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(137, 'porygon', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/137.png', 'A POKéMON that consists entirely of programming code. Capable of moving freely in cyberspace.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(138, 'omanyte', 'rock', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/138.png', 'Although long extinct, in rare cases, it can be genetically resurrected from fossils.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(139, 'omastar', 'rock', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/139.png', 'A prehistoric POKéMON that died out when its heavy shell made it impossible to catch prey.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(140, 'kabuto', 'rock', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/140.png', 'A POKéMON that was resurrected from a fossil found in what was once the ocean floor eons ago.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(141, 'kabutops', 'rock', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/141.png', 'Its sleek shape is perfect for swim­ ming. It slashes prey with its claws and drains the body fluids.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(142, 'aerodactyl', 'rock', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/142.png', 'A ferocious, pre­ historic POKéMON that goes for the enemy\'s throat with its serrated saw-like fangs.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(143, 'snorlax', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/143.png', 'Very lazy. Just eats and sleeps. As its rotund bulk builds, it becomes steadily more slothful.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(144, 'articuno', 'ice', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/144.png', 'A legendary bird POKéMON that is said to appear to doomed people who are lost in icy mountains.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(145, 'zapdos', 'electric', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/145.png', 'A legendary bird POKéMON that is said to appear from clouds while dropping enormous lightning bolts.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(146, 'moltres', 'fire', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/146.png', 'Legendary bird POKéMON. It is said to migrate from the south along with the spring.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(147, 'dratini', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/147.png', 'Long considered a mythical POKéMON until recently when a small colony was found living underwater.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(148, 'dragonair', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/148.png', 'A mystical POKéMON that exudes a gentle aura. Has the ability to change climate conditions.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(149, 'dragonite', 'dragon', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/149.png', 'An extremely rarely seen marine POKéMON. Its intelligence is said to match that of humans.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(150, 'mewtwo', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/150.png', 'It was created by a scientist after years of horrific gene splicing and DNA engineering experiments.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(151, 'mew', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/151.png', 'So rare that it is still said to be a mirage by many experts. Only a few people have seen it worldwide.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(152, 'chikorita', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/152.png', 'A sweet aroma gently wafts from the leaf on its head. It is docile and loves to soak up the sun\'s rays.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(153, 'bayleef', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/153.png', 'The buds that ring its neck give off a spicy aroma that perks people up.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(154, 'meganium', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/154.png', 'Its breath has the fantastic ability to revive dead plants and flowers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(155, 'cyndaquil', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/155.png', 'It is timid, and always curls it­ self up in a ball. If attacked, it flares up its back for protection.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(156, 'quilava', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/156.png', 'Be careful if it turns its back during battle. It means that it will attack with the fire on its back.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(157, 'typhlosion', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/157.png', 'If its rage peaks, it becomes so hot that anything that touches it will instantly go up in flames.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(158, 'totodile', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/158.png', 'Its well-developed jaws are powerful and capable of crushing anything. Even its trainer must be careful.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(159, 'croconaw', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/159.png', 'If it loses a fang, a new one grows back in its place. There are always 48 fangs lining its mouth.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(160, 'feraligatr', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/160.png', 'When it bites with its massive and powerful jaws, it shakes its head and savagely tears its victim up.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(161, 'sentret', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/161.png', 'It has a very nervous nature. It stands up high on its tail so it can scan wide areas.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(162, 'furret', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/162.png', 'It makes a nest to suit its long and skinny body. The nest is impossible for other POKéMON to enter.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(163, 'hoothoot', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/163.png', 'It always stands on one foot. It changes feet so fast, the movement can rarely be seen.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(164, 'noctowl', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/164.png', 'Its eyes are specially adapted. They concentrate even faint light and enable it to see in the dark.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(165, 'ledyba', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/165.png', 'It is very timid. It will be afraid to move if it is alone. But it will be active if it is in a group.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(166, 'ledian', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/166.png', 'When the stars flicker in the night sky, it flutters about, scattering a glowing powder.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(167, 'spinarak', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/167.png', 'It lies still in the same pose for days in its web, waiting for its unsuspecting prey to wander close.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(168, 'ariados', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/168.png', 'ARIADOS’s feet are tipped with tiny hooked claws that enable it to scuttle on ceilings and vertical walls. This POKéMON constricts the foe with thin and strong silk webbing.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(169, 'crobat', 'poison', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/169.png', 'It flies so si­ lently through the dark on its four wings that it may not be noticed even when nearby.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(170, 'chinchou', 'water', 'electric', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/170.png', 'It shoots positive and negative elec­ tricity between the tips of its two antennae and zaps its enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(171, 'lanturn', 'water', 'electric', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/171.png', 'Lanturn’s light can shine up from great depths. It is nicknamed “The Deep-Sea Star.”');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(172, 'pichu', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/172.png', 'It is not yet skilled at storing electricity. It may send out a jolt if amused or startled.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(173, 'cleffa', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/173.png', 'Because of its unusual, star-like silhouette, people believe that it came here on a meteor.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(174, 'igglybuff', 'normal', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/174.png', 'It has a very soft body. If it starts to roll, it will bounce all over and be impossible to stop.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(175, 'togepi', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/175.png', 'The shell seems to be filled with joy. It is said that it will share good luck when treated kindly.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(176, 'togetic', 'fairy', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/176.png', 'To share its happiness, it flies around the world seeking kind­ hearted people.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(177, 'natu', 'psychic', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/177.png', 'Because its wings aren\'t yet fully grown, it has to hop to get around. It is always star­ ing at something.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(178, 'xatu', 'psychic', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/178.png', 'They say that it stays still and quiet because it is seeing both the past and future at the same time.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(179, 'mareep', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/179.png', 'If static elec­ tricity builds in its body, its fleece doubles in volume. Touching it will shock you.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(180, 'flaaffy', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/180.png', 'As a result of storing too much electricity, it developed patches where even downy wool won\'t grow.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(181, 'ampharos', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/181.png', 'The tail\'s tip shines brightly and can be seen from far away. It acts as a beacon for lost people.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(182, 'bellossom', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/182.png', 'BELLOSSOM gather at times and appear to dance. They say that the dance is a ritual to summon the sun.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(183, 'marill', 'water', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/183.png', 'The fur on its body naturally repels water. It can stay dry, even when it plays in the water.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(184, 'azumarill', 'water', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/184.png', 'By keeping still and listening in­ tently, it can tell what is in even wild, fast- moving rivers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(185, 'sudowoodo', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/185.png', 'Although it always pretends to be a tree, its composi­ tion appears to be closer to a rock than a plant.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(186, 'politoed', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/186.png', 'If POLIWAG and POLIWHIRL hear its echoing cry, they respond by gather­ ing from far and wide.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(187, 'hoppip', 'grass', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/187.png', 'To keep from being blown away by the wind, they gather in clusters. They do enjoy gentle breezes, though.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(188, 'skiploom', 'grass', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/188.png', 'The bloom on top of its head opens and closes as the temperature fluc­ tuates up and down.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(189, 'jumpluff', 'grass', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/189.png', 'Blown by seasonal winds, it circles the globe, scattering cotton spores as it goes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(190, 'aipom', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/190.png', 'Its tail is so powerful that it can use it to grab a tree branch and hold itself up in the air.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(191, 'sunkern', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/191.png', 'It may drop out of the sky suddenly. If attacked by a SPEAROW, it will violently shake its leaves.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(192, 'sunflora', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/192.png', 'It converts sun­ light into energy. In the darkness after sunset, it closes its petals and becomes still.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(193, 'yanma', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/193.png', 'If it flaps its wings really fast, it can generate shock waves that will shatter win­ dows in the area.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(194, 'wooper', 'water', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/194.png', 'When it walks a­ round on the ground, it coats its body with a slimy, poisonous film.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(195, 'quagsire', 'water', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/195.png', 'This carefree POKéMON has an easy-going nature. While swimming, it always bumps into boat hulls.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(196, 'espeon', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/196.png', 'It uses the fine hair that covers its body to sense air currents and predict its ene­ my\'s actions.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(197, 'umbreon', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/197.png', 'When agitated, this POKéMON pro­ tects itself by spraying poisonous sweat from its pores.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(198, 'murkrow', 'dark', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/198.png', 'Feared and loathed by many, it is believed to bring misfortune to all those who see it at night.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(199, 'slowking', 'water', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/199.png', 'It has incredible intellect and in­ tuition. Whatever the situation, it remains calm and collected.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(200, 'misdreavus', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/200.png', 'It likes playing mischievous tricks such as screaming and wailing to startle people at night.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(201, 'unown', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/201.png', 'Their shapes look like hieroglyphs on ancient tab­ lets. It is said that the two are somehow related.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(202, 'wobbuffet', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/202.png', 'It hates light and shock. If attack­ ed, it inflates its body to pump up its counter­ strike.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(203, 'girafarig', 'normal', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/203.png', 'Its tail has a small brain of its own. Beware! If you get close, it may react to your scent and bite.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(204, 'pineco', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/204.png', 'It likes to make its shell thicker by adding layers of tree bark. The additional weight doesn\'t bother it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(205, 'forretress', 'bug', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/205.png', 'Its entire body is shielded by a steel-hard shell. What lurks inside the armor is a total mystery.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(206, 'dunsparce', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/206.png', 'When spotted, this POKéMON escapes backward by furi­ ously boring into the ground with its tail.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(207, 'gligar', 'ground', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/207.png', 'It flies straight at its target\'s face then clamps down on the star­ tled victim to inject poison.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(208, 'steelix', 'steel', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/208.png', 'The iron it ingested with the soil it swallowed transformed its body and made it harder than diamonds.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(209, 'snubbull', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/209.png', 'Although it looks frightening, it is actually kind and affectionate. It is very popular among women.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(210, 'granbull', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/210.png', 'It is actually timid and easily spooked. If at­ tacked, it flails about to fend off its attacker.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(211, 'qwilfish', 'water', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/211.png', 'To fire its poison spikes, it must inflate its body by drinking over 2.6 gallons of water all at once.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(212, 'scizor', 'bug', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/212.png', 'It swings its eye- patterned pincers up to scare its foes. This makes it look like it has three heads.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(213, 'shuckle', 'bug', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/213.png', 'The BERRIES it stores in its vase-like shell decompose and become a gooey liquid.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(214, 'heracross', 'bug', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/214.png', 'This powerful POKéMON thrusts its prized horn under its enemies’ bellies then lifts and throws them.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(215, 'sneasel', 'dark', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/215.png', 'Its paws conceal sharp claws. If attacked, it sud­ denly extends the claws and startles its enemy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(216, 'teddiursa', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/216.png', 'If it finds honey, its crescent mark glows. It always licks its paws because they are soaked with honey.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(217, 'ursaring', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/217.png', 'Although it is a good climber, it prefers to snap trees with its forelegs and eat fallen BERRIES.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(218, 'slugma', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/218.png', 'It never sleeps. It has to keep moving because if it stopped, its magma body would cool and harden.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(219, 'magcargo', 'fire', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/219.png', 'The shell on its back is just skin that has cooled and hardened. It breaks easily with a slight touch.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(220, 'swinub', 'ice', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/220.png', 'It rubs its snout on the ground to find and dig up food. It sometimes discovers hot springs.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(221, 'piloswine', 'ice', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/221.png', 'Because the long hair all over its body obscures its sight, it just keeps charging repeatedly.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(222, 'corsola', 'water', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/222.png', 'They prefer unpolluted southern seas. Their coral branches lose their color and deteriorate in dirty water.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(223, 'remoraid', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/223.png', 'It has superb ac­ curacy. The water it shoots out can strike even moving prey from more than 300 feet.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(224, 'octillery', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/224.png', 'It traps enemies with its suction- cupped tentacles then smashes them with its rock-hard head.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(225, 'delibird', 'ice', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/225.png', 'It carries food all day long. There are tales about lost people who were saved by the food it had.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(226, 'mantine', 'water', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/226.png', 'As it majestically swims, it doesn\'t care if REMORAID attach to it for scavenging its leftovers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(227, 'skarmory', 'steel', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/227.png', 'Its sturdy wings look heavy, but they are actually hollow and light, allowing it to fly freely in the sky.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(228, 'houndour', 'dark', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/228.png', 'It uses different kinds of cries for communicating with others of its kind and for pursuing its prey.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(229, 'houndoom', 'dark', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/229.png', 'If you are burned by the flames it shoots from its mouth, the pain will never go away.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(230, 'kingdra', 'water', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/230.png', 'It is said that it usually hides in underwater caves. It can create whirlpools by yawning.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(231, 'phanpy', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/231.png', 'It swings its long snout around play­ fully, but because it is so strong, that can be dan­ gerous.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(232, 'donphan', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/232.png', 'It has sharp, hard tusks and a rugged hide. Its TACKLE is strong enough to knock down a house.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(233, 'porygon2', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/233.png', 'This upgraded version of PORYGON is designed for space exploration. It can\'t fly, though.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(234, 'stantler', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/234.png', 'The curved antlers subtly change the flow of air to create a strange space where real­ ity is distorted.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(235, 'smeargle', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/235.png', 'A special fluid oozes from the tip of its tail. It paints the fluid everywhere to mark its territory.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(236, 'tyrogue', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/236.png', 'It is always bursting with en­ ergy. To make it­ self stronger, it keeps on fighting even if it loses.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(237, 'hitmontop', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/237.png', 'If you become enchanted by its smooth, elegant, dance-like kicks, you may get drilled hard.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(238, 'smoochum', 'ice', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/238.png', 'Its lips are the most sensitive parts on its body. It always uses its lips first to examine things.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(239, 'elekid', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/239.png', 'It rotates its arms to generate electricity, but it tires easily, so it charges up only a little bit.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(240, 'magby', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/240.png', 'Each and every time it inhales and exhales, hot embers dribble out of its mouth and nostrils.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(241, 'miltank', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/241.png', 'Its milk is packed with nutrition, making it the ultimate beverage for the sick or weary.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(242, 'blissey', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/242.png', 'Anyone who takes even one bite of BLISSEY\'s egg be­ comes unfailingly caring and pleas­ ant to everyone.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(243, 'raikou', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/243.png', 'The rain clouds it carries let it fire thunderbolts at will. They say that it descended with lightning.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(244, 'entei', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/244.png', 'Volcanoes erupt when it barks. Un­ able to restrain its extreme power, it races headlong around the land.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(245, 'suicune', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/245.png', 'Said to be the reincarnation of north winds, it can instantly purify filthy, murky water.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(246, 'larvitar', 'rock', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/246.png', 'It feeds on soil. After it has eaten a large mountain, it will fall asleep so it can grow.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(247, 'pupitar', 'rock', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/247.png', 'Its shell is as hard as sheet rock, and it is also very strong. Its THRASHING can topple a mountain.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(248, 'tyranitar', 'rock', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/248.png', 'Its body can\'t be harmed by any sort of attack, so it is very eager to make challenges against enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(249, 'lugia', 'psychic', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/249.png', 'It is said that it quietly spends its time deep at the bottom of the sea because its powers are too strong.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(250, 'ho-oh', 'fire', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/250.png', 'Legends claim this POKéMON flies the world\'s skies con­ tinuously on its magnificent seven- colored wings.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(251, 'celebi', 'psychic', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/251.png', 'This POKéMON wan­ ders across time. Grass and trees flourish in the forests in which it has appeared.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(252, 'treecko', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/252.png', 'TREECKO has small hooks on the bottom of its feet that enable it to scale vertical walls. This POKéMON attacks by slamming foes with its thick tail.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(253, 'grovyle', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/253.png', 'The leaves growing out of GROVYLE’s body are convenient for camouflaging it from enemies in the forest. This POKéMON is a master at climbing trees in jungles.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(254, 'sceptile', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/254.png', 'The leaves growing on SCEPTILE’s body are very sharp edged. This POKéMON is very agile - it leaps all over the branches of trees and jumps on its foe from above or behind.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(255, 'torchic', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/255.png', 'TORCHIC sticks with its TRAINER, following behind with unsteady steps. This POKéMON breathes fire of over 1,800 degrees F, including fireballs that leave the foe scorched black.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(256, 'combusken', 'fire', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/256.png', 'COMBUSKEN toughens up its legs and thighs by running through fields and mountains. This POKéMON’s legs possess both speed and power, enabling it to dole out ten kicks in one second.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(257, 'blaziken', 'fire', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/257.png', 'In battle, BLAZIKEN blows out intense flames from its wrists and attacks foes courageously. The stronger the foe, the more intensely this POKéMON’s wrists burn.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(258, 'mudkip', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/258.png', 'The fin on MUDKIP’s head acts as highly sensitive radar. Using this fin to sense movements of water and air, this POKéMON can determine what is taking place around it without using its eyes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(259, 'marshtomp', 'water', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/259.png', 'The surface of MARSHTOMP’s body is enveloped by a thin, sticky film that enables it to live on land. This POKéMON plays in mud on beaches when the ocean tide is low.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(260, 'swampert', 'water', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/260.png', 'SWAMPERT is very strong. It has enough power to easily drag a boulder weighing more than a ton. This POKéMON also has powerful vision that lets it see even in murky water.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(261, 'poochyena', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/261.png', 'At first sight, POOCHYENA takes a bite at anything that moves. This POKéMON chases after prey until the victim becomes exhausted. However, it may turn tail if the prey strikes back.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(262, 'mightyena', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/262.png', 'MIGHTYENA gives obvious signals when it is preparing to attack. It starts to growl deeply and then flattens its body. This POKéMON will bite savagely with its sharply pointed fangs.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(263, 'zigzagoon', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/263.png', 'ZIGZAGOON restlessly wanders everywhere at all times. This POKéMON does so because it is very curious. It becomes interested in anything that it happens to see.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(264, 'linoone', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/264.png', 'LINOONE always runs full speed and only in straight lines. If facing an obstacle, it makes a right-angle turn to evade it. This POKéMON is very challenged by gently curving roads.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(265, 'wurmple', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/265.png', 'Using the spikes on its rear end, WURMPLE peels the bark off trees and feeds on the sap that oozes out. This POKéMON’s feet are tipped with suction pads that allow it to cling to glass without slipping.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(266, 'silcoon', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/266.png', 'SILCOON tethers itself to a tree branch using silk to keep from falling. There, this POKéMON hangs quietly while it awaits evolution. It peers out of the silk cocoon through a small hole.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(267, 'beautifly', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/267.png', 'BEAUTIFLY’s favorite food is the sweet pollen of flowers. If you want to see this POKéMON, just leave a potted flower by an open window. BEAUTIFLY is sure to come looking for pollen.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(268, 'cascoon', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/268.png', 'CASCOON makes its protective cocoon by wrapping its body entirely with a fine silk from its mouth. Once the silk goes around its body, it hardens. This POKéMON prepares for its evolution inside the cocoon.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(269, 'dustox', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/269.png', 'DUSTOX is instinctively drawn to light. Swarms of this POKéMON are attracted by the bright lights of cities, where they wreak havoc by stripping the leaves off roadside trees for food.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(270, 'lotad', 'water', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/270.png', 'It looks like an aquatic plant and serves as a ferry to Pokémon that can’t swim.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(271, 'lombre', 'water', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/271.png', 'LOMBRE is nocturnal - it will get active after dusk. It is also a mischief-maker. When this POKéMON spots anglers, it tugs on their fishing lines from beneath the surface and enjoys their consternation.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(272, 'ludicolo', 'water', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/272.png', 'LUDICOLO begins dancing as soon as it hears cheerful, festive music. This POKéMON is said to appear when it hears the singing of children on hiking outings.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(273, 'seedot', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/273.png', 'SEEDOT attaches itself to a tree branch using the top of its head. It sucks moisture from the tree while hanging off the branch. The more water it drinks, the glossier this POKéMON’s body becomes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(274, 'nuzleaf', 'grass', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/274.png', 'NUZLEAF live in densely overgrown forests. They occasionally venture out of the forest to startle people. This POKéMON dislikes having its long nose pinched.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(275, 'shiftry', 'grass', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/275.png', 'SHIFTRY is a mysterious POKéMON that is said to live atop towering trees dating back over a thousand years. It creates terrific windstorms with the fans it holds.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(276, 'taillow', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/276.png', 'It has a gutsy spirit that makes it bravely take on tough foes. It flies in search of warm climates.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(277, 'swellow', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/277.png', 'SWELLOW flies high above our heads, making graceful arcs in the sky. This POKéMON dives at a steep angle as soon as it spots its prey. The hapless prey is tightly grasped by SWELLOW’s clawed feet, preventing escape.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(278, 'wingull', 'water', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/278.png', 'WINGULL has the habit of carrying prey and valuables in its beak and hiding them in all sorts of locations. This POKéMON rides the winds and flies as if it were skating across the sky.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(279, 'pelipper', 'water', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/279.png', 'It is a messenger of the skies, carrying small Pokémon and eggs to safety in its bill.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(280, 'ralts', 'psychic', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/280.png', 'RALTS senses the emotions of people using the horns on its head. This POKéMON rarely appears before people. But when it does, it draws closer if it senses that the person has a positive disposition.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(281, 'kirlia', 'psychic', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/281.png', 'If its Trainer becomes happy, it overflows with energy, dancing joyously while spinning about.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(282, 'gardevoir', 'psychic', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/282.png', 'GARDEVOIR has the ability to read the future. If it senses impending danger to its TRAINER, this POKéMON is said to unleash its psychokinetic energy at full power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(283, 'surskit', 'bug', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/283.png', 'From the tips of its feet, SURSKIT secretes an oil that enables it to walk on water as if it were skating. This POKéMON feeds on microscopic organisms in ponds and lakes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(284, 'masquerain', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/284.png', 'MASQUERAIN intimidates enemies with the eyelike patterns on its antennas. This POKéMON flaps its four wings to freely fly in any direction - even sideways and backwards - as if it were a helicopter.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(285, 'shroomish', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/285.png', 'SHROOMISH live in damp soil in the dark depths of forests. They are often found keeping still under fallen leaves. This POKéMON feeds on compost that is made up of fallen, rotted leaves.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(286, 'breloom', 'grass', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/286.png', 'BRELOOM closes in on its foe with light and sprightly footwork, then throws punches with its stretchy arms. This POKéMON’s fighting technique puts boxers to shame.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(287, 'slakoth', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/287.png', 'SLAKOTH lolls around for over twenty hours every day. Because it moves so little, it does not need much food. This POKéMON’s sole daily meal consists of just three leaves.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(288, 'vigoroth', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/288.png', 'Its heart beats at a tenfold tempo, so it cannot sit still for even a moment.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(289, 'slaking', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/289.png', 'SLAKING spends all day lying down and lolling about. It eats grass growing within its reach. If it eats all the grass it can reach, this POKéMON reluctantly moves to another spot.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(290, 'nincada', 'bug', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/290.png', 'NINCADA lives underground for many years in complete darkness. This POKéMON absorbs nutrients from the roots of trees. It stays motionless as it waits for evolution.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(291, 'ninjask', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/291.png', 'NINJASK moves around at such a high speed that it cannot be seen, even while its crying can be clearly heard. For that reason, this POKéMON was long believed to be invisible.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(292, 'shedinja', 'bug', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/292.png', 'SHEDINJA’s hard body doesn’t move - not even a twitch. In fact, its body appears to be merely a hollow shell. It is believed that this POKéMON will steal the spirit of anyone peering into its hollow body from its back.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(293, 'whismur', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/293.png', 'Normally, WHISMUR’s voice is very quiet - it is barely audible even if one is paying close attention. However, if this POKéMON senses danger, it starts crying at an earsplitting volume.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(294, 'loudred', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/294.png', 'LOUDRED’s bellowing can completely decimate a wood-frame house. It uses its voice to punish its foes. This POKéMON’s round ears serve as loudspeakers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(295, 'exploud', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/295.png', 'EXPLOUD triggers earthquakes with the tremors it creates by bellowing. If this POKéMON violently inhales from the ports on its body, it’s a sign that it is preparing to let loose a huge bellow.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(296, 'makuhita', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/296.png', 'MAKUHITA is tenacious - it will keep getting up and attacking its foe however many times it is knocked down. Every time it gets back up, this POKéMON stores more energy in its body for evolving.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(297, 'hariyama', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/297.png', 'HARIYAMA practices its straight-arm slaps in any number of locations. One hit of this POKéMON’s powerful, openhanded, straight-arm punches could snap a telephone pole in two.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(298, 'azurill', 'normal', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/298.png', 'AZURILL spins its tail as if it were a lasso, then hurls it far. The momentum of the throw sends its body flying, too. Using this unique action, one of these POKéMON managed to hurl itself a record 33 feet.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(299, 'nosepass', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/299.png', 'NOSEPASS’s magnetic nose is always pointed to the north. If two of these POKéMON meet, they cannot turn their faces to each other when they are close because their magnetic noses repel one another.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(300, 'skitty', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/300.png', 'SKITTY has the habit of becoming fascinated by moving objects and chasing them around. This POKéMON is known to chase after its own tail and become dizzy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(301, 'delcatty', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/301.png', 'DELCATTY prefers to live an unfettered existence in which it can do as it pleases at its own pace. Because this POKéMON eats and sleeps whenever it decides, its daily routines are completely random.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(302, 'sableye', 'dark', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/302.png', 'SABLEYE lead quiet lives deep inside caverns. They are feared, however, because these POKéMON are thought to steal the spirits of people when their eyes burn with a sinister glow in the darkness.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(303, 'mawile', 'steel', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/303.png', 'MAWHILE’s huge jaws are actually steel horns that have been transformed. Its docile-looking face serves to lull its foe into letting down its guard. When the foe least expects it, MAWHILE chomps it with its gaping jaws.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(304, 'aron', 'steel', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/304.png', 'This POKéMON has a body of steel. To make its body, ARON feeds on iron ore that it digs from mountains. Occasionally, it causes major trouble by eating bridges and rails.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(305, 'lairon', 'steel', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/305.png', 'LAIRON tempers its steel body by drinking highly nutritious mineral springwater until it is bloated. This POKéMON makes its nest close to springs of delicious water.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(306, 'aggron', 'steel', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/306.png', 'AGGRON claims an entire mountain as its own territory. It mercilessly beats up anything that violates its environment. This POKéMON vigilantly patrols its territory at all times.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(307, 'meditite', 'fighting', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/307.png', 'MEDITITE undertakes rigorous mental training deep in the mountains. However, whenever it meditates, this POKéMON always loses its concentration and focus. As a result, its training never ends.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(308, 'medicham', 'fighting', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/308.png', 'It gains the ability to see the aura of its opponents by honing its mind through starvation.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(309, 'electrike', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/309.png', 'ELECTRIKE stores electricity in its long body hair. This POKéMON stimulates its leg muscles with electric charges. These jolts of power give its legs explosive acceleration performance.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(310, 'manectric', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/310.png', 'MANECTRIC is constantly discharging electricity from its mane. The sparks sometimes ignite forest fires. When it enters a battle, this POKéMON creates thunderclouds.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(311, 'plusle', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/311.png', 'PLUSLE always acts as a cheerleader for its partners. Whenever a teammate puts out a good effort in battle, this POKéMON shorts out its body to create the crackling noises of sparks to show its joy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(312, 'minun', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/312.png', 'MINUN is more concerned about cheering on its partners than its own safety. It shorts out the electricity in its body to create brilliant showers of sparks to cheer on its teammates.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(313, 'volbeat', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/313.png', 'With the arrival of night, VOLBEAT emits light from its tail. It communicates with others by adjusting the intensity and flashing of its light. This POKéMON is attracted by the sweet aroma of ILLUMISE.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(314, 'illumise', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/314.png', 'ILLUMISE attracts a swarm of VOLBEAT using a sweet fragrance. Once the VOLBEAT have gathered, this POKéMON leads the lit-up swarm in drawing geometric designs on the canvas of the night sky.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(315, 'roselia', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/315.png', 'ROSELIA shoots sharp thorns as projectiles at any opponent that tries to steal the flowers on its arms. The aroma of this POKéMON brings serenity to living things.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(316, 'gulpin', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/316.png', 'Virtually all of GULPIN’s body is its stomach. As a result, it can swallow something its own size. This POKéMON’s stomach contains a special fluid that digests anything.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(317, 'swalot', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/317.png', 'It swallows anything whole. It sweats toxic fluids from its follicles to douse foes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(318, 'carvanha', 'water', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/318.png', 'CARVANHA’s strongly developed jaws and its sharply pointed fangs pack the destructive power to rip out boat hulls. Many boats have been attacked and sunk by this POKéMON.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(319, 'sharpedo', 'water', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/319.png', 'Nicknamed “the bully of the sea,” SHARPEDO is widely feared. Its cruel fangs grow back immediately if they snap off. Just one of these POKéMON can thoroughly tear apart a supertanker.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(320, 'wailmer', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/320.png', 'WAILMER’s nostrils are located above its eyes. This playful POKéMON loves to startle people by forcefully snorting out seawater it stores inside its body out of its nostrils.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(321, 'wailord', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/321.png', 'WAILORD is the largest of all identified POKéMON up to now. This giant POKéMON swims languorously in the vast open sea, eating massive amounts of food at once with its enormous mouth.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(322, 'numel', 'fire', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/322.png', 'NUMEL is extremely dull witted - it doesn’t notice being hit. However, it can’t stand hunger for even a second. This POKéMON’s body is a seething cauldron of boiling magma.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(323, 'camerupt', 'fire', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/323.png', 'CAMERUPT has a volcano inside its body. Magma of 18,000 degrees F courses through its body. Occasionally, the humps on this POKéMON’s back erupt, spewing the superheated magma.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(324, 'torkoal', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/324.png', 'TORKOAL digs through mountains in search of coal. If it finds some, it fills hollow spaces on its shell with the coal and burns it. If it is attacked, this POKéMON spouts thick black smoke to beat a retreat.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(325, 'spoink', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/325.png', 'SPOINK bounces around on its tail. The shock of its bouncing makes its heart pump. As a result, this POKéMON cannot afford to stop bouncing - if it stops, its heart will stop.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(326, 'grumpig', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/326.png', 'GRUMPIG uses the black pearls on its body to amplify its psychic power waves for gaining total control over its foe. When this POKéMON uses its special power, its snorting breath grows labored.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(327, 'spinda', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/327.png', 'No two SPINDA have the same pattern of spots. Its tottering step fouls the aim of foes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(328, 'trapinch', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/328.png', 'TRAPINCH’s nest is a sloped, bowl-like pit dug in sand. This POKéMON patiently waits for prey to tumble down the pit. Its giant jaws have enough strength to crush even boulders.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(329, 'vibrava', 'ground', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/329.png', 'To make prey faint, VIBRAVA generates ultrasonic waves by vigorously making its two wings vibrate. This POKéMON’s ultrasonic waves are so powerful, they can bring on headaches in people.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(330, 'flygon', 'ground', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/330.png', 'FLYGON is nicknamed “the elemental spirit of the desert.” Because its flapping wings whip up a cloud of sand, this POKéMON is always enveloped in a sandstorm while flying.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(331, 'cacnea', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/331.png', 'CACNEA lives in arid locations such as deserts. It releases a strong aroma from its flower to attract prey. When prey comes near, this POKéMON shoots sharp thorns from its body to bring the victim down.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(332, 'cacturne', 'grass', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/332.png', 'During the daytime, CACTURNE remains unmoving so that it does not lose any moisture to the harsh desert sun. This POKéMON becomes active at night when the temperature drops.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(333, 'swablu', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/333.png', 'SWABLU has light and fluffy wings that are like cottony clouds. This POKéMON is not frightened of people. It lands on the heads of people and sits there like a cotton-fluff hat.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(334, 'altaria', 'dragon', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/334.png', 'It flies gracefully through the sky. Its melodic humming makes you feel like you’re in a dream.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(335, 'zangoose', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/335.png', 'Memories of battling its arch-rival SEVIPER are etched into every cell of ZANGOOSE’s body. This POKéMON adroitly dodges attacks with incredible agility.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(336, 'seviper', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/336.png', 'SEVIPER shares a generations-long feud with ZANGOOSE. The scars on its body are evidence of vicious battles. This POKéMON attacks using its sword- edged tail.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(337, 'lunatone', 'rock', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/337.png', 'LUNATONE was discovered at a location where a meteorite fell. As a result, some people theorize that this POKéMON came from space. However, no one has been able to prove this theory so far.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(338, 'solrock', 'rock', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/338.png', 'A new Pokémon species, rumored to be from the sun. It gives off light while spinning.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(339, 'barboach', 'water', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/339.png', 'BARBOACH’s sensitive whiskers serve as a superb radar system. This POKéMON hides in mud, leaving only its two whiskers exposed while it waits for prey to come along.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(340, 'whiscash', 'water', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/340.png', 'WHISCASH is extremely territorial. Just one of these POKéMON will claim a large pond as its exclusive territory. If a foe approaches it, it thrashes about and triggers a massive earthquake.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(341, 'corphish', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/341.png', 'CORPHISH were originally foreign POKéMON that were imported as pets. They eventually turned up in the wild. This POKéMON is very hardy and has greatly increased its population.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(342, 'crawdaunt', 'water', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/342.png', 'CRAWDAUNT has an extremely violent nature that compels it to challenge other living things to battle. Other life-forms refuse to live in ponds inhabited by this POKéMON, making them desolate places.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(343, 'baltoy', 'ground', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/343.png', 'BALTOY moves while spinning around on its one foot. Primitive wall paintings depicting this POKéMON living among people were discovered in some ancient ruins.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(344, 'claydol', 'ground', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/344.png', 'CLAYDOL are said to be dolls of mud made by primitive humans and brought to life by exposure to a mysterious ray. This POKéMON moves about while levitating.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(345, 'lileep', 'rock', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/345.png', 'LILEEP became extinct approximately a hundred million years ago. This ancient POKéMON attaches itself to a rock on the seafloor and catches approaching prey using tentacles shaped like flower petals.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(346, 'cradily', 'rock', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/346.png', 'CRADILY roams around the ocean floor in search of food. This POKéMON freely extends its tree trunk-like neck and captures unwary prey using its eight tentacles.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(347, 'anorith', 'rock', 'bug', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/347.png', 'ANORITH was regenerated from a prehistoric fossil. This primitive POKéMON once lived in warm seas. It grips its prey firmly between its two large claws.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(348, 'armaldo', 'rock', 'bug', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/348.png', 'ARMALDO’s tough armor makes all attacks bounce off. This POKéMON’s two enormous claws can be freely extended or contracted. They have the power to punch right through a steel slab.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(349, 'feebas', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/349.png', 'FEEBAS’s fins are ragged and tattered from the start of its life. Because of its shoddy appearance, this POKéMON is largely ignored. It is capable of living in both the sea and in rivers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(350, 'milotic', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/350.png', 'MILOTIC is said to be the most beautiful of all the POKéMON. It has the power to becalm such emotions as anger and hostility to quell bitter feuding.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(351, 'castform', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/351.png', 'CASTFORM’s appearance changes with the weather. This POKéMON gained the ability to use the vast power of nature to protect its tiny body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(352, 'kecleon', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/352.png', 'KECLEON is capable of changing its body colors at will to blend in with its surroundings. There is one exception - this POKéMON can’t change the zigzag pattern on its belly.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(353, 'shuppet', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/353.png', 'There’s a proverb that says, “Shun the house where Shuppet gather in the growing dusk.”');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(354, 'banette', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/354.png', 'BANETTE generates energy for laying strong curses by sticking pins into its own body. This POKéMON was originally a pitiful plush doll that was thrown away.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(355, 'duskull', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/355.png', 'DUSKULL can pass through any wall no matter how thick it may be. Once this POKéMON chooses a target, it will doggedly pursue the intended victim until the break of dawn.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(356, 'dusclops', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/356.png', 'DUSCLOPS’s body is completely hollow - there is nothing at all inside. It is said that its body is like a black hole. This POKéMON will absorb anything into its body, but nothing will ever come back out.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(357, 'tropius', 'grass', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/357.png', 'The bunches of fruit around TROPIUS’s neck are very popular with children. This POKéMON loves fruit, and eats it continuously. Apparently, its love for fruit resulted in its own outgrowth of fruit.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(358, 'chimecho', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/358.png', 'CHIMECHO makes its cries echo inside its hollow body. When this POKéMON becomes enraged, its cries result in ultrasonic waves that have the power to knock foes flying.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(359, 'absol', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/359.png', 'Every time ABSOL appears before people, it is followed by a disaster such as an earthquake or a tidal wave. As a result, it came to be known as the disaster POKéMON.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(360, 'wynaut', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/360.png', 'WYNAUT can always be seen with a big, happy smile on its face. Look at its tail to determine if it is angry. When angered, this POKéMON will be slapping the ground with its tail.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(361, 'snorunt', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/361.png', 'SNORUNT live in regions with heavy snowfall. In seasons without snow, such as spring and summer, this POKéMON steals away to live quietly among stalactites and stalagmites deep in caverns.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(362, 'glalie', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/362.png', 'GLALIE has a body made of rock, which it hardens with an armor of ice. This POKéMON has the ability to freeze moisture in the atmosphere into any shape it desires.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(363, 'spheal', 'ice', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/363.png', 'SPHEAL is much faster rolling than walking to get around. When groups of this POKéMON eat, they all clap at once to show their pleasure. Because of this, their mealtimes are noisy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(364, 'sealeo', 'ice', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/364.png', 'SEALEO has the habit of always juggling on the tip of its nose anything it sees for the first time. This POKéMON occasionally entertains itself by balancing and rolling a SPHEAL on its nose.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(365, 'walrein', 'ice', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/365.png', 'WALREIN’s two massively developed tusks can totally shatter blocks of ice weighing ten tons with one blow. This POKéMON’s thick coat of blubber insulates it from subzero temperatures.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(366, 'clamperl', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/366.png', 'CLAMPERL’s sturdy shell is not only good for protection - it is also used for clamping and catching prey. A fully grown CLAMPERL’s shell will be scored with nicks and scratches all over.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(367, 'huntail', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/367.png', 'HUNTAIL’s presence went unnoticed by people for a long time because it lives at extreme depths in the sea. This POKéMON’s eyes can see clearly even in the murky dark depths of the ocean.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(368, 'gorebyss', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/368.png', 'GOREBYSS lives in the southern seas at extreme depths. Its body is built to withstand the enormous pressure of water at incredible depths. Because of this, this POKéMON’s body is unharmed by ordinary attacks.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(369, 'relicanth', 'water', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/369.png', 'RELICANTH is a POKéMON species that existed for a hundred million years without ever changing its form. This ancient POKéMON feeds on microscopic organisms with its toothless mouth.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(370, 'luvdisc', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/370.png', 'LUVDISC live in shallow seas in the tropics. This heart-shaped POKéMON earned its name by swimming after loving couples it spotted in the ocean’s waves.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(371, 'bagon', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/371.png', 'BAGON has a dream of one day soaring in the sky. In doomed efforts to fly, this POKéMON hurls itself off cliffs. As a result of its dives, its head has grown tough and as hard as tempered steel.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(372, 'shelgon', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/372.png', 'Inside SHELGON’s armor-like shell, cells are in the midst of transformation to create an entirely new body. This POKéMON’s shell is extremely heavy, making its movements sluggish.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(373, 'salamence', 'dragon', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/373.png', 'SALAMENCE came about as a result of a strong, long-held dream of growing wings. It is said that this powerful desire triggered a sudden mutation in this POKéMON’s cells, causing it to sprout its magnificent wings.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(374, 'beldum', 'steel', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/374.png', 'Instead of blood, a powerful magnetic force courses throughout BELDUM’s body. This POKéMON communicates with others by sending controlled pulses of magnetism.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(375, 'metang', 'steel', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/375.png', 'When two BELDUM fuse together, METANG is formed. The brains of the BELDUM are joined by a magnetic nervous system. By linking its brains magnetically, this POKéMON generates strong psychokinetic power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(376, 'metagross', 'steel', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/376.png', 'METAGROSS has four brains in total. Combined, the four brains can breeze through difficult calculations faster than a supercomputer. This POKéMON can float in the air by tucking in its four legs.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(377, 'regirock', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/377.png', 'REGIROCK was sealed away by people long ago. If this POKéMON’s body is damaged in battle, it is said to seek out suitable rocks on its own to repair itself.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(378, 'regice', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/378.png', 'REGICE’s body was made during an ice age. The deep-frozen body can’t be melted, even by fire. This POKéMON controls frigid air of minus 328 degrees F.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(379, 'registeel', 'steel', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/379.png', 'REGISTEEL has a body that is harder than any kind of metal. Its body is apparently hollow. No one has any idea what this POKéMON eats.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(380, 'latias', 'dragon', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/380.png', 'LATIAS is highly sensitive to the emotions of people. If it senses any hostility, this POKéMON ruffles the feathers all over its body and cries shrilly to intimidate the foe.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(381, 'latios', 'dragon', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/381.png', 'LATIOS has the ability to make its foe see an image of what it has seen or imagines in its head. This POKéMON is intelligent and understands human speech.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(382, 'kyogre', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/382.png', 'KYOGRE has the power to create massive rain clouds that cover the entire sky and bring about torrential downpours. This POKéMON saved people who were suffering from droughts.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(383, 'groudon', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/383.png', 'GROUDON has long been described in mythology as the POKéMON that raised lands and expanded continents. This POKéMON took to sleep after a cataclysmic battle with KYOGRE.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(384, 'rayquaza', 'dragon', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/384.png', 'RAYQUAZA lived for hundreds of millions of years in the earth’s ozone layer, never descending to the ground. This POKéMON appears to feed on water and particles in the atmosphere.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(385, 'jirachi', 'steel', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/385.png', 'A legend states that JIRACHI will make true any wish that is written on notes attached to its head when it awakens. If this POKéMON senses danger, it will fight without awakening.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(386, 'deoxys', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/386.png', 'An alien virus that fell to earth on a meteor underwent a DNA mutation to become this Pokémon.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(387, 'turtwig', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/387.png', 'Made from soil, the shell on its back hardens when it drinks water. It lives along lakes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(388, 'grotle', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/388.png', 'It lives along water in forests. In the daytime, it leaves the forest to sunbathe its treed shell.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(389, 'torterra', 'grass', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/389.png', 'Small Pokémon occasionally gather on its unmoving back to begin building their nests.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(390, 'chimchar', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/390.png', 'It agilely scales sheer cliffs to live atop craggy mountains. Its fire is put out when it sleeps.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(391, 'monferno', 'fire', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/391.png', 'To intimidate attackers, it stretches the fire on its tail to make itself appear bigger.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(392, 'infernape', 'fire', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/392.png', 'It uses a special kind of martial arts involving all its limbs. Its fire never goes out.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(393, 'piplup', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/393.png', 'Because it is very proud, it hates accepting food from people. Its thick down guards it from cold.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(394, 'prinplup', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/394.png', 'It lives alone, away from others. Apparently, every one of them believes it is the most important.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(395, 'empoleon', 'water', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/395.png', 'The three horns that extend from its beak attest to its power. The leader has the biggest horns.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(396, 'starly', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/396.png', 'They flock in great numbers. Though small, they flap their wings with great power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(397, 'staravia', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/397.png', 'It flies around forests and fields in search of bug Pokémon. It stays within a huge flock.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(398, 'staraptor', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/398.png', 'It has a savage nature. It will courageously challenge foes that are much larger.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(399, 'bidoof', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/399.png', 'With nerves of steel, nothing can perturb it. It is more agile and active than it appears.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(400, 'bibarel', 'normal', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/400.png', 'It makes its nest by damming streams with bark and mud. It is known as an industrious worker.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(401, 'kricketot', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/401.png', 'It shakes its head back to front, causing its antennae to hit each other and sound like a xylophone.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(402, 'kricketune', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/402.png', 'It crosses its knifelike arms in front of its chest when it cries. It can compose melodies ad lib.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(403, 'shinx', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/403.png', 'All of its fur dazzles if danger is sensed. It flees while the foe is momentarily blinded.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(404, 'luxio', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/404.png', 'Its claws loose electricity with enough amperage to cause fainting. They live in small groups.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(405, 'luxray', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/405.png', 'It has eyes that can see through anything. It spots and captures prey hiding behind objects.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(406, 'budew', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/406.png', 'Over the winter, it closes its bud and endures the cold. In spring, the bud opens and releases pollen.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(407, 'roserade', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/407.png', 'It attracts prey with a sweet aroma, then downs it with thorny whips hidden in its arms.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(408, 'cranidos', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/408.png', 'It lived in jungles around 100 million years ago. Its skull is as hard as iron.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(409, 'rampardos', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/409.png', 'Its powerful head butt has enough power to shatter even the most durable things upon impact.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(410, 'shieldon', 'rock', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/410.png', 'A Pokémon that lived in jungles around 100 million years ago. Its facial hide is extremely hard.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(411, 'bastiodon', 'rock', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/411.png', 'Any frontal attack is repulsed. It is a docile Pokémon that feeds on grass and berries.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(412, 'burmy', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/412.png', 'To shelter itself from cold, wintry winds, it covers itself with a cloak made of twigs and leaves.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(413, 'wormadam', 'bug', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/413.png', 'When BURMY evolved, its cloak became a part of this Pokémon’s body. The cloak is never shed.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(414, 'mothim', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/414.png', 'It loves the honey of flowers and steals honey collected by Combee.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(415, 'combee', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/415.png', 'A Pokémon formed by three others. It busily carries sweet floral honey to VESPIQUEN.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(416, 'vespiquen', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/416.png', 'Its abdomen is a honeycomb for grubs. It raises its grubs on honey collected by COMBEE.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(417, 'pachirisu', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/417.png', 'It makes fur balls that crackle with static electricity. It stores them with berries in tree holes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(418, 'buizel', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/418.png', 'It has a flotation sac that is like an inflatable collar. It floats on water with its head out.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(419, 'floatzel', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/419.png', 'It floats using its well-developed flotation sac. It assists in the rescues of drowning people.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(420, 'cherubi', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/420.png', 'The small ball holds the nutrients needed for evolution. Apparently, it is very sweet and tasty.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(421, 'cherrim', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/421.png', 'It blooms during times of strong sunlight. It tries to make up for everything it endured as a bud.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(422, 'shellos', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/422.png', 'Its colors and shapes differ from region to region. In the Sinnoh region, two types are confirmed.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(423, 'gastrodon', 'water', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/423.png', 'It has a pliable body without any bones. If any part of its body is torn off, it grows right back.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(424, 'ambipom', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/424.png', 'To eat, it deftly shucks nuts with its two tails. It rarely uses its arms now.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(425, 'drifloon', 'ghost', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/425.png', 'A Pokémon formed by the spirits of people and Pokémon. It loves damp, humid seasons.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(426, 'drifblim', 'ghost', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/426.png', 'It’s drowzy in daytime, but flies off in the evening in big groups. No one knows where they go.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(427, 'buneary', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/427.png', 'It slams foes by sharply uncoiling its rolled ears. It stings enough to make a grown-up cry in pain.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(428, 'lopunny', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/428.png', 'An extremely cautious Pokémon. It cloaks its body with its fluffy ear fur when it senses danger.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(429, 'mismagius', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/429.png', 'Its cries sound like incantations. Those hearing it are tormented by headaches and hallucinations.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(430, 'honchkrow', 'dark', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/430.png', 'Becoming active at night, it is known to swarm with numerous MURKROW in tow.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(431, 'glameow', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/431.png', 'It claws if displeased and purrs when affectionate. Its fickleness is very popular among some.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(432, 'purugly', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/432.png', 'It is a brazen brute that barges its way into another Pokémon’s nest and claims it as its own.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(433, 'chingling', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/433.png', 'It emits cries by agitating an orb at the back of its throat. It moves with flouncing hops.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(434, 'stunky', 'poison', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/434.png', 'It protects itself by spraying a noxious fluid from its rear. The stench lingers for 24 hours.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(435, 'skuntank', 'poison', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/435.png', 'It sprays a vile-smelling fluid from the tip of its tail to attack. Its range is over 160 feet.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(436, 'bronzor', 'steel', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/436.png', 'Implements shaped like it were discovered in ancient tombs. It is unknown if they are related.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(437, 'bronzong', 'steel', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/437.png', 'One caused a news sensation when it was dug up at a construction site after a 2,000-year sleep.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(438, 'bonsly', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/438.png', 'It looks as if it is always crying. It is actually adjusting its body’s fluid levels by eliminating excess.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(439, 'mime-jr', 'psychic', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/439.png', 'It habitually mimics foes. Once mimicked, the foe cannot take its eyes off this Pokémon.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(440, 'happiny', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/440.png', 'It loves round white things. It carries an egg-shaped rock in imitation of CHANSEY.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(441, 'chatot', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/441.png', 'It can learn and speak human words. If they gather, they all learn the same saying.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(442, 'spiritomb', 'ghost', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/442.png', 'A Pokémon that was formed by 108 spirits. It is bound to a fissure in an odd keystone.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(443, 'gible', 'dragon', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/443.png', 'It nests in small, horizontal holes in cave walls. It pounces to catch prey that stray too close.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(444, 'gabite', 'dragon', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/444.png', 'There is a long-held belief that medicine made from its scales will heal even incurable illnesses.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(445, 'garchomp', 'dragon', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/445.png', 'When it folds up its body and extends its wings, it looks like a jet plane. It flies at sonic speed.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(446, 'munchlax', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/446.png', 'It wolfs down its weight in food once a day, swallowing food whole with almost no chewing.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(447, 'riolu', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/447.png', 'The aura that emanates from its body intensifies to alert others if it is afraid or sad.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(448, 'lucario', 'fighting', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/448.png', 'It has the ability to sense the auras of all things. It understands human speech.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(449, 'hippopotas', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/449.png', 'It lives in arid places. Instead of perspiration, it expels grainy sand from its body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(450, 'hippowdon', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/450.png', 'It blasts internally stored sand from ports on its body to create a towering twister for attack.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(451, 'skorupi', 'poison', 'bug', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/451.png', 'It grips prey with its tail claws and injects poison. It tenaciously hangs on until the poison takes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(452, 'drapion', 'poison', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/452.png', 'It has the power in its clawed arms to make scrap of a car. The tips of its claws release poison.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(453, 'croagunk', 'poison', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/453.png', 'Its cheeks hold poison sacs. It tries to catch foes off guard to jab them with toxic fingers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(454, 'toxicroak', 'poison', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/454.png', 'Its knuckle claws secrete a toxin so vile that even a scratch could prove fatal.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(455, 'carnivine', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/455.png', 'It attracts prey with its sweet- smelling saliva, then chomps down. It takes a whole day to eat prey.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(456, 'finneon', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/456.png', 'The line running down its side can store sunlight. It shines vividly at night.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(457, 'lumineon', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/457.png', 'It lives on the deep-sea floor. It attracts prey by flashing the patterns on its four tail fins.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(458, 'mantyke', 'water', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/458.png', 'A friendly Pokémon that captures the subtle flows of seawater using its two antennae.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(459, 'snover', 'grass', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/459.png', 'It lives on snowy mountains. Having had little contact with humans, it is boldly inquisitive.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(460, 'abomasnow', 'grass', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/460.png', 'It whips up blizzards in mountains that are always buried in snow. It is the abominable snowman.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(461, 'weavile', 'dark', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/461.png', 'They live in cold regions, forming groups of four or five that hunt prey with impressive coordination.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(462, 'magnezone', 'electric', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/462.png', 'It evolved from exposure to a special magnetic field. Three units generate magnetism.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(463, 'lickilicky', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/463.png', 'It wraps things with its extensible tongue. Getting too close to it will leave you soaked with drool.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(464, 'rhyperior', 'ground', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/464.png', 'It puts rocks in holes in its palms and uses its muscles to shoot them. GEODUDE are shot at rare times.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(465, 'tangrowth', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/465.png', 'It ensnares prey by extending arms made of vines. Losing arms to predators does not trouble it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(466, 'electivire', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/466.png', 'It pushes the tips of its two tails against the foe, then lets loose with over 20,000 volts of power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(467, 'magmortar', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/467.png', 'It blasts fireballs of over 3,600 degrees F from the ends of its arms. It lives in volcanic craters.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(468, 'togekiss', 'fairy', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/468.png', 'It will never appear where there is strife. Its sightings have become rare recently.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(469, 'yanmega', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/469.png', 'By churning its wings, it creates shock waves that inflict critical internal injuries to foes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(470, 'leafeon', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/470.png', 'Just like a plant, it uses photosynthesis. As a result, it is always enveloped in clear air.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(471, 'glaceon', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/471.png', 'As a protective technique, it can completely freeze its fur to make its hairs stand like needles.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(472, 'gliscor', 'ground', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/472.png', 'It observes prey while hanging inverted from branches. When the chance presents itself, it swoops!');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(473, 'mamoswine', 'ice', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/473.png', 'Its impressive tusks are made of ice. The population thinned when it turned warm after the ice age.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(474, 'porygon-z', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/474.png', 'Additional software was installed to make it a better Pokémon. It began acting oddly, however.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(475, 'gallade', 'psychic', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/475.png', 'A master of courtesy and swordsmanship, it fights using extending swords on its elbows.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(476, 'probopass', 'rock', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/476.png', 'It freely controls three small units called Mini-Noses using magnetic force.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(477, 'dusknoir', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/477.png', 'The antenna on its head captures radio waves from the world of spirits that command it to take people there.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(478, 'froslass', 'ice', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/478.png', 'It freezes foes with an icy breath nearly -60 degrees F. What seems to be its body is actually hollow.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(479, 'rotom', 'electric', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/479.png', 'Its body is composed of plasma. It is known to infiltrate electronic devices and wreak havoc.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(480, 'uxie', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/480.png', 'Known as “The Being of Knowledge.” It is said that it can wipe out the memory of those who see its eyes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(481, 'mesprit', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/481.png', 'Known as “The Being of Emotion.” It taught humans the nobility of sorrow, pain, and joy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(482, 'azelf', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/482.png', 'Known as “The Being of Willpower.” It sleeps at the bottom of a lake to keep the world in balance.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(483, 'dialga', 'steel', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/483.png', 'It has the power to control time. It appears in Sinnoh-region myths as an ancient deity.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(484, 'palkia', 'water', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/484.png', 'It has the ability to distort space. It is described as a deity in Sinnoh-region mythology.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(485, 'heatran', 'fire', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/485.png', 'It dwells in volcanic caves. It digs in with its cross-shaped feet to crawl on ceilings and walls.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(486, 'regigigas', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/486.png', 'There is an enduring legend that states this Pokémon towed continents with ropes.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(487, 'giratina', 'ghost', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/487.png', 'A Pokémon that is said to live in a world on the reverse side of ours. It appears in an ancient cemetery.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(488, 'cresselia', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/488.png', 'Shiny particles are released from its wings like a veil. It is said to represent the crescent moon.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(489, 'phione', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/489.png', 'A Pokémon that lives in warm seas. It inflates the flotation sac on its head to drift and search for food.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(490, 'manaphy', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/490.png', 'Born on a cold seafloor, it will swim great distances to return to its birthplace.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(491, 'darkrai', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/491.png', 'It can lull people to sleep and make them dream. It is active during nights of the new moon.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(492, 'shaymin', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/492.png', 'It lives in flower patches and avoids detection by curling up to look like a flowering plant.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(493, 'arceus', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/493.png', 'It is described in mythology as the Pokémon that shaped the universe with its 1,000 arms.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(494, 'victini', 'psychic', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/494.png', 'This Pokémon brings victory. It is said that Trainers with Victini always win, regardless of the type of encounter.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(495, 'snivy', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/495.png', 'It is very intelligent and calm. Being exposed to lots of sunlight makes its movements swifter.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(496, 'servine', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/496.png', 'It moves along the ground as if sliding. Its swift movements befuddle its foes, and it then attacks with a vine whip.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(497, 'serperior', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/497.png', 'It can stop its opponents’ movements with just a glare. It takes in solar energy and boosts it internally.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(498, 'tepig', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/498.png', 'It can deftly dodge its foe’s attacks while shooting fireballs from its nose. It roasts berries before it eats them.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(499, 'pignite', 'fire', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/499.png', 'When its internal fire flares up, its movements grow sharper and faster. When in trouble, it emits smoke.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(500, 'emboar', 'fire', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/500.png', 'It has mastered fast and powerful fighting moves. It grows a beard of fire.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(501, 'oshawott', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/501.png', 'It fights using the scalchop on its stomach. In response to an attack, it retaliates immediately by slashing.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(502, 'dewott', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/502.png', 'Strict training is how it learns its flowing double-scalchop technique.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(503, 'samurott', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/503.png', 'One swing of the sword incorporated in its armor can fell an opponent. A simple glare from one of them quiets everybody.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(504, 'patrat', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/504.png', 'Using food stored in cheek pouches, they can keep watch for days. They use their tails to communicate with others.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(505, 'watchog', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/505.png', 'When they see an enemy, their tails stand high, and they spit the seeds of berries stored in their cheek pouches.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(506, 'lillipup', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/506.png', 'It faces strong opponents with great courage. But, when at a disadvantage in a fight, this intelligent Pokémon flees.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(507, 'herdier', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/507.png', 'This very loyal Pokémon helps Trainers, and it also takes care of other Pokémon.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(508, 'stoutland', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/508.png', 'It rescues people stranded by blizzards in the mountains. Its shaggy fur shields it from the cold.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(509, 'purrloin', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/509.png', 'They steal from people for fun, but their victims can’t help but forgive them. Their deceptively cute act is perfect.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(510, 'liepard', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/510.png', 'These Pokémon vanish and appear unexpectedly. Many Trainers are drawn to their beautiful form and fur.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(511, 'pansage', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/511.png', 'This Pokémon dwells deep in the forest. Eating a leaf from its head whisks weariness away as if by magic.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(512, 'simisage', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/512.png', 'Ill tempered, it fights by swinging its barbed tail around wildly. The leaf growing on its head is very bitter.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(513, 'pansear', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/513.png', 'When it is angered, the temperature of its head tuft reaches 600° F. It uses its tuft to roast berries.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(514, 'simisear', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/514.png', 'It loves sweets because they become energy for the fire burning inside its body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(515, 'panpour', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/515.png', 'The water stored inside the tuft on its head is full of nutrients. Plants that receive its water grow large.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(516, 'simipour', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/516.png', 'The tuft on its head holds water. When the level runs low, it replenishes the tuft by siphoning up water with its tail.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(517, 'munna', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/517.png', 'Munna always float in the air. People whose dreams are eaten by them forget what the dreams had been about.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(518, 'musharna', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/518.png', 'The mist emanating from their foreheads is packed with the dreams of people and Pokémon.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(519, 'pidove', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/519.png', 'Each follows its Trainer’s orders as best it can, but they sometimes fail to understand complicated commands.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(520, 'tranquill', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/520.png', 'It can return to its Trainer’s location regardless of the distance separating them.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(521, 'unfezant', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/521.png', 'Males swing their head plumage to threaten opponents. The females’ flying abilities surpass those of the males.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(522, 'blitzle', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/522.png', 'Its mane shines when it discharges electricity. They use their flashing manes to communicate with one another.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(523, 'zebstrika', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/523.png', 'They have lightning-like movements. When Zebstrika run at full speed, the sound of thunder reverberates.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(524, 'roggenrola', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/524.png', 'Its ear is hexagonal in shape. Compressed underground, its body is as hard as steel.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(525, 'boldore', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/525.png', 'When it overflows with power, the orange crystal on its body glows. It looks for underground water in caves.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(526, 'gigalith', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/526.png', 'Compressing the energy from its internal core lets it fire off an attack capable of blowing away a mountain.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(527, 'woobat', 'psychic', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/527.png', 'Its habitat is dark forests and caves. It emits ultrasonic waves from its nose to learn about its surroundings.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(528, 'swoobat', 'psychic', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/528.png', 'It emits sound waves of various frequencies from its nose, including some powerful enough to destroy rocks.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(529, 'drilbur', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/529.png', 'It can dig through the ground at a speed of 30 mph. It could give a car running aboveground a good race.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(530, 'excadrill', 'ground', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/530.png', 'It can help in tunnel construction. Its drill has evolved into steel strong enough to bore through iron plates.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(531, 'audino', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/531.png', 'It touches others with the feelers on its ears, using the sound of their heartbeats to tell how they are feeling.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(532, 'timburr', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/532.png', 'It fights by swinging a piece of lumber around. It is close to evolving when it can handle the lumber without difficulty.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(533, 'gurdurr', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/533.png', 'This Pokémon is so muscular and strongly built that even a group of wrestlers could not make it budge an inch.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(534, 'conkeldurr', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/534.png', 'It is thought that Conkeldurr taught humans how to make concrete more than 2,000 years ago.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(535, 'tympole', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/535.png', 'They warn others of danger by vibrating their cheeks to create a high-pitched sound.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(536, 'palpitoad', 'water', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/536.png', 'When they vibrate the bumps on their heads, they can make waves in water or earthquake-like vibrations on land.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(537, 'seismitoad', 'water', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/537.png', 'They shoot paralyzing liquid from their head bumps. They use vibration to hurt their opponents.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(538, 'throh', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/538.png', 'When it tightens its belt, it becomes stronger. Wild Throh use vines to weave their own belts.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(539, 'sawk', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/539.png', 'The sound of Sawk punching boulders and trees can be heard all the way from the mountains where they train.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(540, 'sewaddle', 'bug', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/540.png', 'Leavanny dress it in clothes they made for it when it hatched. It hides its head in its hood while it is sleeping.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(541, 'swadloon', 'bug', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/541.png', 'Forests where Swadloon live have superb foliage because the nutrients they make from fallen leaves nourish the plant life.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(542, 'leavanny', 'bug', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/542.png', 'Upon finding a small Pokémon, it weaves clothing for it from leaves, using the cutters on its arms and sticky silk.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(543, 'venipede', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/543.png', 'Its bite injects a potent poison, enough to paralyze large bird Pokémon that try to prey on it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(544, 'whirlipede', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/544.png', 'Protected by a hard shell, it spins its body like a wheel and crashes furiously into its enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(545, 'scolipede', 'bug', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/545.png', 'With quick movements, it chases down its foes, attacking relentlessly with its horns until it prevails.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(546, 'cottonee', 'grass', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/546.png', 'When attacked, it escapes by shooting cotton from its body. The cotton serves as a decoy to distract the attacker.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(547, 'whimsicott', 'grass', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/547.png', 'Like the wind, it can slip through any gap, no matter how small. It leaves balls of white fluff behind.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(548, 'petilil', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/548.png', 'The leaves on its head are very bitter. Eating one of these leaves is known to refresh a tired body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(549, 'lilligant', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/549.png', 'Even veteran Trainers face a challenge in getting its beautiful flower to bloom. This Pokémon is popular with celebrities.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(550, 'basculin', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/550.png', 'Red and blue Basculin get along so poorly, they’ll start fighting instantly. These Pokémon are very hostile.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(551, 'sandile', 'ground', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/551.png', 'They live buried in the sands of the desert. The sun-warmed sands prevent their body temperature from dropping.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(552, 'krokorok', 'ground', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/552.png', 'They live in groups of a few individuals. Protective membranes shield their eyes from sandstorms.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(553, 'krookodile', 'ground', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/553.png', 'They never allow prey to escape. Their jaws are so powerful, they can crush the body of an automobile.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(554, 'darumaka', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/554.png', 'When its internal fire is burning, it cannot calm down and it runs around. When the fire diminishes, it falls asleep.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(555, 'darmanitan', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/555.png', 'Its internal fire burns at 2,500° F, making enough power that it can destroy a dump truck with one punch.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(556, 'maractus', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/556.png', 'When it moves rhythmically, it makes a sound similar to maracas, making the surprised Pokémon flee.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(557, 'dwebble', 'bug', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/557.png', 'This Pokémon can easily melt holes in hard rocks with a liquid secreted from its mouth.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(558, 'crustle', 'bug', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/558.png', 'Competing for territory, Crustle fight viciously. The one whose boulder is broken is the loser of the battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(559, 'scraggy', 'dark', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/559.png', 'Its skin has a rubbery elasticity, so it can reduce damage by defensively pulling its skin up to its neck.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(560, 'scrafty', 'dark', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/560.png', 'Groups of them beat up anything that enters their territory. Each can spit acidic liquid from its mouth.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(561, 'sigilyph', 'psychic', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/561.png', 'They never vary the route they fly, because their memories of guarding an ancient city remain steadfast.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(562, 'yamask', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/562.png', 'Each of them carries a mask that used to be its face when it was human. Sometimes they look at it and cry.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(563, 'cofagrigus', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/563.png', 'It has been said that they swallow those who get too close and turn them into mummies. They like to eat gold nuggets.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(564, 'tirtouga', 'water', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/564.png', 'Restored from a fossil, this Pokémon can dive to depths beyond half a mile.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(565, 'carracosta', 'water', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/565.png', 'They can live both in the ocean and on land. A slap from one of them is enough to open a hole in the bottom of a tanker.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(566, 'archen', 'rock', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/566.png', 'Said to be an ancestor of bird Pokémon, they were unable to fly and moved about by hopping from one branch to another.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(567, 'archeops', 'rock', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/567.png', 'They are intelligent and will cooperate to catch prey. From the ground, they use a running start to take flight.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(568, 'trubbish', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/568.png', 'Inhaling the gas they belch will make you sleep for a week. They prefer unsanitary places.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(569, 'garbodor', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/569.png', 'It clenches opponents with its left arm and finishes them off with foul-smelling poison gas belched from its mouth.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(570, 'zorua', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/570.png', 'It changes into the forms of others to surprise them. Apparently, it often transforms into a silent child.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(571, 'zoroark', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/571.png', 'Bonds between these Pokémon are very strong. It protects the safety of its pack by tricking its opponents.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(572, 'minccino', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/572.png', 'They greet one another by rubbing each other with their tails, which are always kept well groomed and clean.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(573, 'cinccino', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/573.png', 'Their white fur is coated in a special oil that makes it easy for them to deflect attacks.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(574, 'gothita', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/574.png', 'Their ribbonlike feelers increase their psychic power. They are always staring at something.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(575, 'gothorita', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/575.png', 'They use hypnosis to control people and Pokémon. Tales of Gothorita leading people astray are told in every corner.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(576, 'gothitelle', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/576.png', 'Starry skies thousands of light-years away are visible in the space distorted by their intense psychic power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(577, 'solosis', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/577.png', 'They drive away attackers by unleashing psychic power. They can use telepathy to talk with others.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(578, 'duosion', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/578.png', 'Since they have two divided brains, at times they suddenly try to take two different actions at once.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(579, 'reuniclus', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/579.png', 'When Reuniclus shake hands, a network forms between their brains, increasing their psychic power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(580, 'ducklett', 'water', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/580.png', 'These bird Pokémon are excellent divers. They swim around in the water eating their favorite food--peat moss.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(581, 'swanna', 'water', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/581.png', 'Swanna start to dance at dusk. The one dancing in the middle is the leader of the flock.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(582, 'vanillite', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/582.png', 'The temperature of their breath is -58° F. They create snow crystals and make snow fall in the areas around them.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(583, 'vanillish', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/583.png', 'Snowy mountains are this Pokémon’s habitat. During an ancient ice age, they moved to southern areas.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(584, 'vanilluxe', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/584.png', 'Swallowing large amounts of water, they make snow clouds inside their bodies and attack their foes with violent blizzards.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(585, 'deerling', 'normal', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/585.png', 'The color and scent of their fur changes to match the mountain grass. When they sense hostility, they hide in the grass.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(586, 'sawsbuck', 'normal', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/586.png', 'They migrate according to the seasons. People can tell the season by looking at Sawsbuck’s horns.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(587, 'emolga', 'electric', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/587.png', 'The energy made in its cheeks’ electric pouches is stored inside its membrane and released while it is gliding.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(588, 'karrablast', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/588.png', 'These mysterious Pokémon evolve when they receive electrical stimulation while they are in the same place as Shelmet.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(589, 'escavalier', 'bug', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/589.png', 'They fly around at high speed, striking with their pointed spears. Even when in trouble, they face opponents bravely.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(590, 'foongus', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/590.png', 'It lures people in with its Poké Ball pattern, then releases poison spores. Why it resembles a Poké Ball is unknown.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(591, 'amoonguss', 'grass', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/591.png', 'It lures prey close by dancing and waving its arm caps, which resemble Poké Balls, in a swaying motion.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(592, 'frillish', 'water', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/592.png', 'With its thin, veil-like arms wrapped around the body of its opponent, it sinks to the ocean floor.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(593, 'jellicent', 'water', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/593.png', 'The fate of the ships and crew that wander into Jellicent’s habitat: all sunken, all lost, all vanished.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(594, 'alomomola', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/594.png', 'The special membrane enveloping Alomomola has the ability to heal wounds.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(595, 'joltik', 'bug', 'electric', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/595.png', 'Joltik that live in cities have learned a technique for sucking electricity from the outlets in houses.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(596, 'galvantula', 'bug', 'electric', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/596.png', 'When attacked, they create an electric barrier by spitting out many electrically charged threads.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(597, 'ferroseed', 'grass', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/597.png', 'When threatened, it attacks by shooting a barrage of spikes, which gives it a chance to escape by rolling away.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(598, 'ferrothorn', 'grass', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/598.png', 'It fights by swinging around its three spiky feelers. A hit from these steel spikes can reduce a boulder to rubble.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(599, 'klink', 'steel', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/599.png', 'The two minigears that mesh together are predetermined. Each will rebound from other minigears without meshing.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(600, 'klang', 'steel', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/600.png', 'By changing the direction in which it rotates, it communicates its feelings to others. When angry, it rotates faster.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(601, 'klinklang', 'steel', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/601.png', 'The gear with the red core is rotated at high speed for a rapid energy charge.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(602, 'tynamo', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/602.png', 'While one alone doesn’t have much power, a chain of many Tynamo can be as powerful as lightning.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(603, 'eelektrik', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/603.png', 'They coil around foes and shock them with electricity-generating organs that seem simply to be circular patterns.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(604, 'eelektross', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/604.png', 'They crawl out of the ocean using their arms. They will attack prey on shore and immediately drag it into the ocean.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(605, 'elgyem', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/605.png', 'It uses its strong psychic power to squeeze its opponent’s brain, causing unendurable headaches.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(606, 'beheeyem', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/606.png', 'It can manipulate an opponent’s memory. Apparently, it communicates by flashing its three different-colored fingers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(607, 'litwick', 'ghost', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/607.png', 'Litwick shines a light that absorbs the life energy of people and Pokémon, which becomes the fuel that it burns.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(608, 'lampent', 'ghost', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/608.png', 'This ominous Pokémon is feared. Through cities it wanders, searching for the spirits of the fallen.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(609, 'chandelure', 'ghost', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/609.png', 'It absorbs a spirit, which it then burns. By waving the flames on its arms, it puts its foes into a hypnotic trance.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(610, 'axew', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/610.png', 'They use their tusks to crush the berries they eat. Repeated regrowth makes their tusks strong and sharp.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(611, 'fraxure', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/611.png', 'Since a broken tusk will not grow back, they diligently sharpen their tusks on river rocks after they’ve been fighting.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(612, 'haxorus', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/612.png', 'They are kind but can be relentless when defending territory. They challenge foes with tusks that can cut steel.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(613, 'cubchoo', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/613.png', 'When it is not feeling well, its mucus gets watery and the power of its Ice-type moves decreases.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(614, 'beartic', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/614.png', 'It can make its breath freeze at will. Very able in the water, it swims around in northern seas and catches prey.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(615, 'cryogonal', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/615.png', 'When its body temperature goes up, it turns into steam and vanishes. When its temperature lowers, it returns to ice.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(616, 'shelmet', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/616.png', 'When attacked, it defends itself by closing the lid of its shell. It can spit a sticky, poisonous liquid.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(617, 'accelgor', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/617.png', 'When its body dries out, it weakens. So, to prevent dehydration, it wraps itself in many layers of thin membrane.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(618, 'stunfisk', 'ground', 'electric', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/618.png', 'Its skin is very hard, so it is unhurt even if stepped on by sumo wrestlers. It smiles when transmitting electricity.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(619, 'mienfoo', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/619.png', 'In fights, they dominate with onslaughts of flowing, continuous attacks. With their sharp claws, they cut enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(620, 'mienshao', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/620.png', 'It wields the fur on its arms like a whip. Its arm attacks come with such rapidity that they cannot even be seen.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(621, 'druddigon', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/621.png', 'It warms its body by absorbing sunlight with its wings. When its body temperature falls, it can no longer move.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(622, 'golett', 'ground', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/622.png', 'The energy that burns inside it enables it to move, but no one has yet been able to identify this energy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(623, 'golurk', 'ground', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/623.png', 'It flies across the sky at Mach speeds. Removing the seal on its chest makes its internal energy go out of control.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(624, 'pawniard', 'dark', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/624.png', 'Blades comprise this Pokémon’s entire body. If battling dulls the blades, it sharpens them on stones by the river.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(625, 'bisharp', 'dark', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/625.png', 'It leads a group of Pawniard. It battles to become the boss, but will be driven from the group if it loses.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(626, 'bouffalant', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/626.png', 'Their fluffy fur absorbs damage, even if they strike foes with a fierce headbutt.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(627, 'rufflet', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/627.png', 'They crush berries with their talons. They bravely stand up to any opponent, no matter how strong it is.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(628, 'braviary', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/628.png', 'They fight for their friends without any thought about danger to themselves. One can carry a car while flying.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(629, 'vullaby', 'dark', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/629.png', 'Its wings are too tiny to allow it to fly. As the time approaches for it to evolve, it discards the bones it was wearing.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(630, 'mandibuzz', 'dark', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/630.png', 'It makes a nest out of bones it finds. It grabs weakened prey in its talons and hauls it to its nest of bones.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(631, 'heatmor', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/631.png', 'It breathes through a hole in its tail while it burns with an internal fire. Durant is its prey.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(632, 'durant', 'bug', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/632.png', 'They attack in groups, covering themselves in steel armor to protect themselves from Heatmor.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(633, 'deino', 'dark', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/633.png', 'It tends to bite everything, and it is not a picky eater. Approaching it carelessly is dangerous.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(634, 'zweilous', 'dark', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/634.png', 'After it has eaten up all the food in its territory, it moves to another area. Its two heads do not get along.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(635, 'hydreigon', 'dark', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/635.png', 'This brutal Pokémon travels the skies on its six wings. Anything that moves seems like a foe to it, triggering its attack.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(636, 'larvesta', 'bug', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/636.png', 'This Pokémon was believed to have been born from the sun. When it evolves, its entire body is engulfed in flames.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(637, 'volcarona', 'bug', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/637.png', 'When volcanic ash darkened the atmosphere, it is said that Volcarona’s fire provided a replacement for the sun.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(638, 'cobalion', 'steel', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/638.png', 'This legendary Pokémon battled against humans to protect Pokémon. Its personality is calm and composed.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(639, 'terrakion', 'rock', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/639.png', 'This Pokémon came to the defense of Pokémon that had lost their homes in a war among humans.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(640, 'virizion', 'grass', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/640.png', 'Legends say this Pokémon confounded opponents with its swift movements.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(641, 'tornadus', 'flying', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/641.png', 'The lower half of its body is wrapped in a cloud of energy. It zooms through the sky at 200 mph.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(642, 'thundurus', 'electric', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/642.png', 'Countless charred remains mar the landscape of places through which Thundurus has passed.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(643, 'reshiram', 'dragon', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/643.png', 'This Pokémon appears in legends. It sends flames into the air from its tail, burning up everything around it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(644, 'zekrom', 'dragon', 'electric', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/644.png', 'Concealing itself in lightning clouds, it flies throughout the Unova region. It creates electricity in its tail.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(645, 'landorus', 'ground', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/645.png', 'Lands visited by Landorus grant such bountiful crops that it has been hailed as “The Guardian of the Fields.”');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(646, 'kyurem', 'dragon', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/646.png', 'It generates a powerful, freezing energy inside itself, but its body became frozen when the energy leaked out.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(647, 'keldeo', 'water', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/647.png', 'By blasting water from its hooves, it can glide across water. It excels at using leg moves while battling.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(648, 'meloetta', 'normal', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/648.png', 'Its melodies are sung with a special vocalization method that can control the feelings of those who hear it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(649, 'genesect', 'bug', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/649.png', 'Over 300 million years ago, it was feared as the strongest of hunters. It has been modified by Team Plasma.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(650, 'chespin', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/650.png', 'The quills on its head are usually soft. When it flexes them, the points become so hard and sharp that they can pierce rock.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(651, 'quilladin', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/651.png', 'It relies on its sturdy shell to deflect predators’ attacks. It counterattacks with its sharp quills.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(652, 'chesnaught', 'grass', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/652.png', 'Its Tackle is forceful enough to flip a 50-ton tank. It shields its allies from danger with its own body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(653, 'fennekin', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/653.png', 'Eating a twig fills it with energy, and its roomy ears give vent to air hotter than 390 degrees Fahrenheit.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(654, 'braixen', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/654.png', 'It has a twig stuck in its tail. With friction from its tail fur, it sets the twig on fire and launches into battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(655, 'delphox', 'fire', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/655.png', 'It gazes into the flame at the tip of its branch to achieve a focused state, which allows it to see into the future.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(656, 'froakie', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/656.png', 'It secretes flexible bubbles from its chest and back. The bubbles reduce the damage it would otherwise take when attacked.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(657, 'frogadier', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/657.png', 'It can throw bubble-covered pebbles with precise control, hitting empty cans up to a hundred feet away.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(658, 'greninja', 'water', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/658.png', 'It creates throwing stars out of compressed water. When it spins them and throws them at high speed, these stars can split metal in two.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(659, 'bunnelby', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/659.png', 'They use their large ears to dig burrows. They will dig the whole night through.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(660, 'diggersby', 'normal', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/660.png', 'With their powerful ears, they can heft boulders of a ton or more with ease. They can be a big help at construction sites.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(661, 'fletchling', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/661.png', 'These friendly Pokémon send signals to one another with beautiful chirps and tail-feather movements.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(662, 'fletchinder', 'fire', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/662.png', 'From its beak, it expels embers that set the tall grass on fire. Then it pounces on the bewildered prey that pop out of the grass.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(663, 'talonflame', 'fire', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/663.png', 'In the fever of an exciting battle, it showers embers from the gaps between its feathers and takes to the air.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(664, 'scatterbug', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/664.png', 'When under attack from bird Pokémon, it spews a poisonous black powder that causes paralysis on contact.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(665, 'spewpa', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/665.png', 'It lives hidden within thicket shadows. When predators attack, it quickly bristles the fur covering its body in an effort to threaten them.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(666, 'vivillon', 'bug', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/666.png', 'Vivillon with many different patterns are found all over the world. These patterns are affected by the climate of their habitat.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(667, 'litleo', 'fire', 'normal', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/667.png', 'The stronger the opponent it faces, the more heat surges from its mane and the more power flows through its body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(668, 'pyroar', 'fire', 'normal', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/668.png', 'The male with the largest mane of fire is the leader of the pride.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(669, 'flabebe', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/669.png', 'It draws out and controls the hidden power of flowers. The flower Flabébé holds is most likely part of its body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(670, 'floette', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/670.png', 'It flutters around fields of flowers and cares for flowers that are starting to wilt. It draws out the hidden power of flowers to battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(671, 'florges', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/671.png', 'It claims exquisite flower gardens as its territory, and it obtains power from basking in the energy emitted by flowering plants.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(672, 'skiddo', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/672.png', 'Thought to be one of the first Pokémon to live in harmony with humans, it has a placid disposition.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(673, 'gogoat', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/673.png', 'It can tell how its Trainer is feeling by subtle shifts in the grip on its horns. This empathic sense lets them run as if one being.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(674, 'pancham', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/674.png', 'It does its best to be taken seriously by its enemies, but its glare is not sufficiently intimidating. Chewing on a leaf is its trademark.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(675, 'pangoro', 'fighting', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/675.png', 'Although it possesses a violent temperament, it won’t put up with bullying. It uses the leaf in its mouth to sense the movements of its enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(676, 'furfrou', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/676.png', 'Trimming its fluffy fur not only makes it more elegant but also increases the swiftness of its movements.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(677, 'espurr', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/677.png', 'The organ that emits its intense psychic power is sheltered by its ears to keep power from leaking out.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(678, 'meowstic', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/678.png', 'When in danger, it raises its ears and releases enough psychic power to grind a 10-ton truck into dust.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(679, 'honedge', 'steel', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/679.png', 'Apparently this Pokémon is born when a departed spirit inhabits a sword. It attaches itself to people and drinks their life force.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(680, 'doublade', 'steel', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/680.png', 'When Honedge evolves, it divides into two swords, which cooperate via telepathy to coordinate attacks and slash their enemies to ribbons.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(681, 'aegislash', 'steel', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/681.png', 'Generations of kings were attended by these Pokémon, which used their spectral power to manipulate and control people and Pokémon.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(682, 'spritzee', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/682.png', 'It emits a scent that enraptures those who smell it. This fragrance changes depending on what it has eaten.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(683, 'aromatisse', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/683.png', 'It devises various scents, pleasant and unpleasant, and emits scents that its enemies dislike in order to gain an edge in battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(684, 'swirlix', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/684.png', 'To entangle its opponents in battle, it extrudes white threads as sweet and sticky as cotton candy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(685, 'slurpuff', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/685.png', 'It can distinguish the faintest of scents. It puts its sensitive sense of smell to use by helping pastry chefs in their work.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(686, 'inkay', 'dark', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/686.png', 'Opponents who stare at the flashing of the light-emitting spots on its body become dazed and lose their will to fight.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(687, 'malamar', 'dark', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/687.png', 'It wields the most compelling hypnotic powers of any Pokémon, and it forces others to do whatever it wants.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(688, 'binacle', 'rock', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/688.png', 'Two Binacle live together on one rock. When they fight, one of them will move to a different rock.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(689, 'barbaracle', 'rock', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/689.png', 'When they evolve, two Binacle multiply into seven. They fight with the power of seven Binacle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(690, 'skrelp', 'poison', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/690.png', 'Camouflaged as rotten kelp, they spray liquid poison on prey that approaches unawares and then finish it off.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(691, 'dragalge', 'poison', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/691.png', 'Their poison is strong enough to eat through the hull of a tanker, and they spit it indiscriminately at anything that enters their territory.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(692, 'clauncher', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/692.png', 'They knock down flying prey by firing compressed water from their massive claws like shooting a pistol.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(693, 'clawitzer', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/693.png', 'Their enormous claws launch cannonballs of water powerful enough to pierce tanker hulls.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(694, 'helioptile', 'electric', 'normal', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/694.png', 'They make their home in deserts. They can generate their energy from basking in the sun, so eating food is not a requirement.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(695, 'heliolisk', 'electric', 'normal', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/695.png', 'They flare their frills and generate energy. A single Heliolisk can generate sufficient electricity to power a skyscraper.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(696, 'tyrunt', 'rock', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/696.png', 'This Pokémon was restored from a fossil. If something happens that it doesn’t like, it throws a tantrum and runs wild.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(697, 'tyrantrum', 'rock', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/697.png', 'Thanks to its gargantuan jaws, which could shred thick metal plates as if they were paper, it was invincible in the ancient world it once inhabited.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(698, 'amaura', 'rock', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/698.png', 'This ancient Pokémon was restored from part of its body that had been frozen in ice for over 100 million years.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(699, 'aurorus', 'rock', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/699.png', 'The diamond-shaped crystals on its body expel air as cold as -240 degrees Fahrenheit, surrounding its enemies and encasing them in ice.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(700, 'sylveon', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/700.png', 'It sends a soothing aura from its ribbonlike feelers to calm fights.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(701, 'hawlucha', 'fighting', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/701.png', 'Although its body is small, its proficient fighting skills enable it to keep up with big bruisers like Machamp and Hariyama.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(702, 'dedenne', 'electric', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/702.png', 'Its whiskers serve as antennas. By sending and receiving electrical waves, it can communicate with others over vast distances.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(703, 'carbink', 'rock', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/703.png', 'Born from the temperatures and pressures deep underground, it fires beams from the stone in its head.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(704, 'goomy', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/704.png', 'The weakest Dragon-type Pokémon, it lives in damp, shady places, so its body doesn’t dry out.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(705, 'sliggoo', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/705.png', 'It drives away opponents by excreting a sticky liquid that can dissolve anything. Its eyes devolved, so it can’t see anything.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(706, 'goodra', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/706.png', 'This very friendly Dragon-type Pokémon will hug its beloved Trainer, leaving that Trainer covered in sticky slime.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(707, 'klefki', 'steel', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/707.png', 'These key collectors threaten any attackers by fiercely jingling their keys at them.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(708, 'phantump', 'ghost', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/708.png', 'These Pokémon are created when spirits possess rotten tree stumps. They prefer to live in abandoned forests.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(709, 'trevenant', 'ghost', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/709.png', 'It can control trees at will. It will trap people who harm the forest, so they can never leave.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(710, 'pumpkaboo', 'ghost', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/710.png', 'The pumpkin body is inhabited by a spirit trapped in this world. As the sun sets, it becomes restless and active.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(711, 'gourgeist', 'ghost', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/711.png', 'Singing in eerie voices, they wander town streets on the night of the new moon. Anyone who hears their song is cursed.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(712, 'bergmite', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/712.png', 'It blocks opponents’ attacks with the ice that shields its body. It uses cold air to repair any cracks with new ice.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(713, 'avalugg', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/713.png', 'Its ice-covered body is as hard as steel. Its cumbersome frame crushes anything that stands in its way.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(714, 'noibat', 'flying', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/714.png', 'They live in pitch-black caves. Their enormous ears can emit ultrasonic waves of 200,000 hertz.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(715, 'noivern', 'flying', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/715.png', 'They fly around on moonless nights and attack careless prey. Nothing can beat them in a battle in the dark.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(716, 'xerneas', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/716.png', 'Legends say it can share eternal life. It slept for a thousand years in the form of a tree before its revival.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(717, 'yveltal', 'dark', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/717.png', 'When this legendary Pokémon’s wings and tail feathers spread wide and glow red, it absorbs the life force of living creatures.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(718, 'zygarde', 'dragon', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/718.png', 'When the Kalos region’s ecosystem falls into disarray, it appears and reveals its secret power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(719, 'diancie', 'rock', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/719.png', 'A sudden transformation of Carbink, its pink, glimmering body is said to be the loveliest sight in the whole world.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(720, 'hoopa', 'psychic', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/720.png', 'This troublemaker sends anything and everything to faraway places using its loop, which can warp space.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(721, 'volcanion', 'fire', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/721.png', 'It lets out billows of steam and disappears into the dense fog. It’s said to live in mountains where humans do not tread.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(722, 'rowlet', 'grass', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/722.png', 'This wary Pokémon uses photosynthesis to store up energy during the day, while becoming active at night.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(723, 'dartrix', 'grass', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/723.png', 'A bit of a dandy, it spends its free time preening its wings. Its preoccupation with any dirt on its plumage can leave it unable to battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(724, 'decidueye', 'grass', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/724.png', 'It fires arrow quills from its wings with such precision, they can pierce a pebble at distances over a hundred yards.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(725, 'litten', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/725.png', 'While grooming itself, it builds up fur inside its stomach. It sets the fur alight and spews fiery attacks, which change based on how it coughs.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(726, 'torracat', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/726.png', 'At its throat, it bears a bell of fire. The bell rings brightly whenever this Pokémon spits fire.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(727, 'incineroar', 'fire', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/727.png', 'This Pokémon has a violent, selfish disposition. If it’s not in the mood to listen, it will ignore its Trainer’s orders with complete nonchalance.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(728, 'popplio', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/728.png', 'This Pokémon snorts body fluids from its nose, blowing balloons to smash into its foes. It’s famous for being a hard worker.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(729, 'brionne', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/729.png', 'A skillful dancer, it creates a sequence of water balloons as it dances, and briskly bombards its enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(730, 'primarina', 'water', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/730.png', 'It controls its water balloons with song. The melody is learned from others of its kind and is passed down from one generation to the next.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(731, 'pikipek', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/731.png', 'It can peck at a rate of 16 times a second to drill holes in trees. It uses the holes for food storage and for nesting.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(732, 'trumbeak', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/732.png', 'It eats berries and stores their seeds in its beak. When it encounters enemies or prey, it fires off all the seeds in a burst.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(733, 'toucannon', 'normal', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/733.png', 'When it battles, its beak heats up. The temperature can easily exceed 212 degrees Fahrenheit, causing severe burns when it hits.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(734, 'yungoos', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/734.png', 'With its sharp fangs, it will bite anything. It did not originally live in Alola but was imported from another region.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(735, 'gumshoos', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/735.png', 'When it finds a trace of its prey, it patiently stakes out the location...but it’s always snoozing by nightfall.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(736, 'grubbin', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/736.png', 'Its strong jaw enables it to scrape trees and slurp out the sap. It normally lives underground.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(737, 'charjabug', 'bug', 'electric', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/737.png', 'Its body is capable of storing electricity. On camping trips, people are grateful to have one around.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(738, 'vikavolt', 'bug', 'electric', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/738.png', 'It zips around, on sharp lookout for an opening. It concentrates electrical energy within its large jaws and uses it to zap its enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(739, 'crabrawler', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/739.png', 'While guarding its weak points with its pincers, it looks for an opening and unleashes punches. When it loses, it foams at the mouth and faints.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(740, 'crabominable', 'fighting', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/740.png', 'It aimed for the top but got lost and ended up on a snowy mountain. Being forced to endure the cold, this Pokémon evolved and grew fur.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(741, 'oricorio', 'fire', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/741.png', 'It beats its wings together to create fire. As it moves in the steps of its beautiful dance, it bathes opponents in intense flames.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(742, 'cutiefly', 'bug', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/742.png', 'It feeds on the nectar and pollen of flowers. Because it’s able to sense auras, it can identify which flowers are about to bloom.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(743, 'ribombee', 'bug', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/743.png', 'It rolls up pollen into puffs. It makes many different varieties, some used as food and others used in battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(744, 'rockruff', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/744.png', 'It’s considered to be a good Pokémon for beginners because of its friendliness, but its disposition grows rougher as it grows up.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(745, 'lycanroc', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/745.png', 'Its quick movements confuse its enemies. Well equipped with claws and fangs, it also uses the sharp rocks in its mane as weapons.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(746, 'wishiwashi', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/746.png', 'When it’s in trouble, its eyes moisten and begin to shine. The shining light attracts its comrades, and they stand together against their enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(747, 'mareanie', 'poison', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/747.png', 'It plunges the poison spike on its head into its prey. When the prey has weakened, Mareanie deals the finishing blow with its 10 tentacles.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(748, 'toxapex', 'poison', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/748.png', 'Toxapex crawls along the ocean floor on its 12 legs. It leaves a trail of Corsola bits scattered in its wake.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(749, 'mudbray', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/749.png', 'The mud stuck to Mudbray’s hooves enhances its grip and its powerful running gait.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(750, 'mudsdale', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/750.png', 'It spits a mud that provides resistance to both wind and rain, so the walls of old houses were often coated with it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(751, 'dewpider', 'water', 'bug', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/751.png', 'It crawls onto the land in search of food. Its water bubble allows it to breathe and protects its soft head.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(752, 'araquanid', 'water', 'bug', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/752.png', 'It delivers headbutts with the water bubble on its head. Small Pokémon get sucked into the bubble, where they drown.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(753, 'fomantis', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/753.png', 'During the day, it sleeps and soaks up light. When night falls, it walks around looking for a safer place to sleep.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(754, 'lurantis', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/754.png', 'It requires a lot of effort to maintain Lurantis’s vivid coloring, but some collectors enjoy this work and treat it as their hobby.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(755, 'morelull', 'grass', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/755.png', 'It scatters spores that flicker and glow. Anyone seeing these lights falls into a deep slumber.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(756, 'shiinotic', 'grass', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/756.png', 'Forests where Shiinotic live are treacherous to enter at night. People confused by its strange lights can never find their way home again.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(757, 'salandit', 'poison', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/757.png', 'It burns its bodily fluids to create a poisonous gas. When its enemies become disoriented from inhaling the gas, it attacks them.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(758, 'salazzle', 'poison', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/758.png', 'For some reason, only females have been found. It creates a reverse harem of male Salandit that it lives with.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(759, 'stufful', 'normal', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/759.png', 'Despite its adorable appearance, when it gets angry and flails about, its arms and legs could knock a pro wrestler sprawling.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(760, 'bewear', 'normal', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/760.png', 'This immensely dangerous Pokémon possesses overwhelming physical strength. Its habitat is generally off-limits.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(761, 'bounsweet', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/761.png', 'A delectable aroma pours from its body. They are often swallowed whole by Toucannon lured by that wafting deliciousness.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(762, 'steenee', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/762.png', 'The sepals on its head developed to protect its body. These are quite hard, so even if pecked by bird Pokémon, this Pokémon is totally fine.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(763, 'tsareena', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/763.png', 'Its long, striking legs aren’t just for show but to be used to kick with skill. In victory, it shows off by kicking the defeated, laughing boisterously.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(764, 'comfey', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/764.png', 'It attaches flowers to its highly nutritious vine. This revitalizes the flowers, and they give off an aromatic scent.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(765, 'oranguru', 'normal', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/765.png', 'Known for its extreme intelligence, this Pokémon will look down on inexperienced Trainers, so it’s best suited to veteran Trainers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(766, 'passimian', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/766.png', 'They form groups of roughly 20 individuals. Their mutual bond is remarkable—they will never let down a comrade.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(767, 'wimpod', 'bug', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/767.png', 'This Pokémon is a coward. As it desperately dashes off, the flailing of its many legs leaves a sparkling clean path in its wake.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(768, 'golisopod', 'bug', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/768.png', 'With a flashing slash of its giant sharp claws, it cleaves seawater—or even air—right in two.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(769, 'sandygast', 'ghost', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/769.png', 'Born from a sand mound playfully built by a child, this Pokémon embodies the grudges of the departed.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(770, 'palossand', 'ghost', 'ground', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/770.png', 'Possessed people controlled by this Pokémon transformed its sand mound into a castle. As it evolved, its power to curse grew ever stronger.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(771, 'pyukumuku', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/771.png', 'It lives in shallow seas, such as areas near a beach. It can eject its internal organs, which it uses to engulf its prey or battle enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(772, 'type-null', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/772.png', 'The heavy control mask it wears suppresses its intrinsic capabilities. This Pokémon has some hidden special power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(773, 'silvally', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/773.png', 'Its trust in its partner is what awakens it. This Pokémon is capable of changing its type, a flexibility that is well displayed in battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(774, 'minior', 'rock', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/774.png', 'Originally making its home in the ozone layer, it hurtles to the ground when the shell enclosing its body grows too heavy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(775, 'komala', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/775.png', 'It is born asleep, and it dies asleep. All its movements are apparently no more than the results of it tossing and turning in its dreams.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(776, 'turtonator', 'fire', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/776.png', 'The shell on its back is chemically unstable and explodes violently if struck. The hole in its stomach is its weak point.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(777, 'togedemaru', 'electric', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/777.png', 'The spiny fur on its back is normally at rest. When this Pokémon becomes agitated, its fur stands on end and stabs into its attackers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(778, 'mimikyu', 'ghost', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/778.png', 'Its actual appearance is unknown. A scholar who saw what was under its rag was overwhelmed by terror and died from the shock.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(779, 'bruxish', 'water', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/779.png', 'When it unleashes its psychic power from the protuberance on its head, the grating sound of grinding teeth echoes through the area.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(780, 'drampa', 'normal', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/780.png', 'It has a compassionate personality, but if it is angered, it completely destroys its surroundings with its intense breath.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(781, 'dhelmise', 'ghost', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/781.png', 'Swinging its massive anchor, it can KO Wailord in a single blow. What appears to be green seaweed is actually its body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(782, 'jangmo-o', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/782.png', 'It expresses its feelings by smacking its scales. Metallic sounds echo through the tall mountains where Jangmo-o lives.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(783, 'hakamo-o', 'dragon', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/783.png', 'It leaps at its prey with a courageous shout. Its scaly punches tear its opponents to shreds.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(784, 'kommo-o', 'dragon', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/784.png', 'When it spots enemies, it threatens them by jingling the scales on its tail. Weak opponents will crack and flee in panic.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(785, 'tapu-koko', 'electric', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/785.png', 'This guardian deity of Melemele is brimming with curiosity. It summons thunderclouds and stores their lightning inside its body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(786, 'tapu-lele', 'psychic', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/786.png', 'This guardian deity of Akala is guilelessly cruel. The fragrant aroma of flowers is the source of its energy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(787, 'tapu-bulu', 'grass', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/787.png', 'It pulls large trees up by the roots and swings them around. It causes vegetation to grow, and then it absorbs energy from the growth.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(788, 'tapu-fini', 'water', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/788.png', 'Although it’s called a guardian deity, terrible calamities sometimes befall those who recklessly approach Tapu Fini.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(789, 'cosmog', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/789.png', 'Its body is gaseous and frail. It slowly grows as it collects dust from the atmosphere.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(790, 'cosmoem', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/790.png', 'Motionless as if dead, its body is faintly warm to the touch. In the distant past, it was called the cocoon of the stars.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(791, 'solgaleo', 'psychic', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/791.png', 'It is said to live in another world. The intense light it radiates from the surface of its body can make the darkest of nights light up like midday.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(792, 'lunala', 'psychic', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/792.png', 'It is said to be a female evolution of Cosmog. When its third eye activates, away it flies to another world.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(793, 'nihilego', 'rock', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/793.png', 'One of several mysterious Ultra Beasts. People on the street report observing those infested by it suddenly becoming violent.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(794, 'buzzwole', 'bug', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/794.png', 'This Ultra Beast appeared from another world. It shows off its body, but whether that display is a boast or a threat remains unclear.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(795, 'pheromosa', 'bug', 'fighting', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/795.png', 'One of the dangerous Ultra Beasts, it has been spotted running across the land at terrific speeds.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(796, 'xurkitree', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/796.png', 'One of the mysterious life-forms known as Ultra Beasts. Astonishing electric shocks emanate from its entire body, according to witnesses.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(797, 'celesteela', 'steel', 'flying', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/797.png', 'It appeared from the Ultra Wormhole. Witnesses observed it flying across the sky at high speed.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(798, 'kartana', 'grass', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/798.png', 'This Ultra Beast came from the Ultra Wormhole. It seems not to attack enemies on its own, but its sharp body is a dangerous weapon in itself.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(799, 'guzzlord', 'dark', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/799.png', 'It has gobbled mountains and swallowed whole buildings, according to reports. It’s one of the Ultra Beasts.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(800, 'necrozma', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/800.png', 'Reminiscent of the Ultra Beasts, this life-form, apparently asleep underground, is thought to have come from another world in ancient times.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(801, 'magearna', 'steel', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/801.png', 'This artificial Pokémon, constructed more than 500 years ago, can understand human speech but cannot itself speak.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(802, 'marshadow', 'fighting', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/802.png', 'Able to conceal itself in shadows, it never appears before humans, so its very existence was the stuff of myth.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(803, 'poipole', 'poison', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/803.png', 'This Ultra Beast is well enough liked to be chosen as a first partner in its own world.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(804, 'naganadel', 'poison', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/804.png', 'It stores hundreds of liters of poisonous liquid inside its body. It is one of the organisms known as UBs.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(805, 'stakataka', 'rock', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/805.png', 'It appeared from an Ultra Wormhole. Each one appears to be made up of many life-forms stacked one on top of each other.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(806, 'blacephalon', 'fire', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/806.png', 'It slithers toward people. Then, without warning, it triggers the explosion of its own head. It’s apparently one kind of Ultra Beast.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(807, 'zeraora', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/807.png', 'It electrifies its claws and tears its opponents apart with them. Even if they dodge its attack, they’ll be electrocuted by the flying sparks.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(808, 'meltan', 'steel', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/808.png', 'It melts particles of iron and other metals found in the subsoil, so it can absorb them into its body of molten steel.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(809, 'melmetal', 'steel', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/809.png', 'Revered long ago for its capacity to create iron from nothing, for some reason it has come back to life after 3,000 years.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(810, 'grookey', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/810.png', 'When it uses its special stick to strike up a beat, the sound waves produced carry revitalizing energy to the plants and flowers in the area.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(811, 'thwackey', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/811.png', 'The faster a Thwackey can beat out a rhythm with its two sticks, the more respect it wins from its peers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(812, 'rillaboom', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/812.png', 'By drumming, it taps into the power of its special tree stump. The roots of the stump follow its direction in battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(813, 'scorbunny', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/813.png', 'A warm-up of running around gets fire energy coursing through this Pokémon’s body. Once that happens, it’s ready to fight at full power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(814, 'raboot', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/814.png', 'Its thick and fluffy fur protects it from the cold and enables it to use hotter fire moves.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(815, 'cinderace', 'fire', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/815.png', 'It juggles a pebble with its feet, turning it into a burning soccer ball. Its shots strike opponents hard and leave them scorched.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(816, 'sobble', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/816.png', 'When scared, this Pokémon cries. Its tears pack the chemical punch of 100 onions, and attackers won’t be able to resist weeping.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(817, 'drizzile', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/817.png', 'A clever combatant, this Pokémon battles using water balloons created with moisture secreted from its palms.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(818, 'inteleon', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/818.png', 'It has many hidden capabilities, such as fingertips that can shoot water and a membrane on its back that it can use to glide through the air.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(819, 'skwovet', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/819.png', 'Found throughout the Galar region, this Pokémon becomes uneasy if its cheeks are ever completely empty of berries.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(820, 'greedent', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/820.png', 'It stashes berries in its tail—so many berries that they fall out constantly. But this Pokémon is a bit slow-witted, so it doesn’t notice the loss.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(821, 'rookidee', 'flying', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/821.png', 'It will bravely challenge any opponent, no matter how powerful. This Pokémon benefits from every battle—even a defeat increases its strength a bit.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(822, 'corvisquire', 'flying', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/822.png', 'Smart enough to use tools in battle, these Pokémon have been seen picking up rocks and flinging them or using ropes to wrap up enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(823, 'corviknight', 'flying', 'steel', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/823.png', 'This Pokémon reigns supreme in the skies of the Galar region. The black luster of its steel body could drive terror into the heart of any foe.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(824, 'blipbug', 'bug', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/824.png', 'A constant collector of information, this Pokémon is very smart. Very strong is what it isn’t.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(825, 'dottler', 'bug', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/825.png', 'It barely moves, but it’s still alive. Hiding in its shell without food or water seems to have awakened its psychic powers.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(826, 'orbeetle', 'bug', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/826.png', 'It’s famous for its high level of intelligence, and the large size of its brain is proof that it also possesses immense psychic power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(827, 'nickit', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/827.png', 'Aided by the soft pads on its feet, it silently raids the food stores of other Pokémon. It survives off its ill-gotten gains.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(828, 'thievul', 'dark', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/828.png', 'It secretly marks potential targets with a scent. By following the scent, it stalks its targets and steals from them when they least expect it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(829, 'gossifleur', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/829.png', 'It anchors itself in the ground with its single leg, then basks in the sun. After absorbing enough sunlight, its petals spread as it blooms brilliantly.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(830, 'eldegoss', 'grass', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/830.png', 'The seeds attached to its cotton fluff are full of nutrients. It spreads them on the wind so that plants and other Pokémon can benefit from them.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(831, 'wooloo', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/831.png', 'Its curly fleece is such an effective cushion that this Pokémon could fall off a cliff and stand right back up at the bottom, unharmed.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(832, 'dubwool', 'normal', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/832.png', 'Weave a carpet from its springy wool, and you end up with something closer to a trampoline. You’ll start to bounce the moment you set foot on it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(833, 'chewtle', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/833.png', 'Apparently the itch of its teething impels it to snap its jaws at anything in front of it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(834, 'drednaw', 'water', 'rock', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/834.png', 'With jaws that can shear through steel rods, this highly aggressive Pokémon chomps down on its unfortunate prey.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(835, 'yamper', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/835.png', 'This Pokémon is very popular as a herding dog in the Galar region. As it runs, it generates electricity from the base of its tail.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(836, 'boltund', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/836.png', 'This Pokémon generates electricity and channels it into its legs to keep them going strong. Boltund can run nonstop for three full days.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(837, 'rolycoly', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/837.png', 'Most of its body has the same composition as coal. Fittingly, this Pokémon was first discovered in coal mines about 400 years ago.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(838, 'carkol', 'rock', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/838.png', 'It forms coal inside its body. Coal dropped by this Pokémon once helped fuel the lives of people in the Galar region.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(839, 'coalossal', 'rock', 'fire', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/839.png', 'It’s usually peaceful, but the vandalism of mines enrages it. Offenders will be incinerated with flames that reach 2,700 degrees Fahrenheit.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(840, 'applin', 'grass', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/840.png', 'It spends its entire life inside an apple. It hides from its natural enemies, bird Pokémon, by pretending it’s just an apple and nothing more.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(841, 'flapple', 'grass', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/841.png', 'It ate a sour apple, and that induced its evolution. In its cheeks, it stores an acid capable of causing chemical burns.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(842, 'appletun', 'grass', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/842.png', 'Eating a sweet apple caused its evolution. A nectarous scent wafts from its body, luring in the bug Pokémon it preys on.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(843, 'silicobra', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/843.png', 'As it digs, it swallows sand and stores it in its neck pouch. The pouch can hold more than 17 pounds of sand.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(844, 'sandaconda', 'ground', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/844.png', 'When it contracts its body, over 220 pounds of sand sprays from its nose. If it ever runs out of sand, it becomes disheartened.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(845, 'cramorant', 'flying', 'water', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/845.png', 'It’s so strong that it can knock out some opponents in a single hit, but it also may forget what it’s battling midfight.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(846, 'arrokuda', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/846.png', 'If it sees any movement around it, this Pokémon charges for it straightaway, leading with its sharply pointed jaw. It’s very proud of that jaw.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(847, 'barraskewda', 'water', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/847.png', 'This Pokémon has a jaw that’s as sharp as a spear and as strong as steel. Apparently Barraskewda’s flesh is surprisingly tasty, too.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(848, 'toxel', 'electric', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/848.png', 'It stores poison in an internal poison sac and secretes that poison through its skin. If you touch this Pokémon, a tingling sensation follows.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(849, 'toxtricity', 'electric', 'poison', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/849.png', 'When this Pokémon sounds as if it’s strumming a guitar, it’s actually clawing at the protrusions on its chest to generate electricity.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(850, 'sizzlipede', 'fire', 'bug', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/850.png', 'It stores flammable gas in its body and uses it to generate heat. The yellow sections on its belly get particularly hot.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(851, 'centiskorch', 'fire', 'bug', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/851.png', 'When it heats up, its body temperature reaches about 1,500 degrees Fahrenheit. It lashes its body like a whip and launches itself at enemies.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(852, 'clobbopus', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/852.png', 'It’s very curious, but its means of investigating things is to try to punch them with its tentacles. The search for food is what brings it onto land.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(853, 'grapploct', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/853.png', 'A body made up of nothing but muscle makes the grappling moves this Pokémon performs with its tentacles tremendously powerful.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(854, 'sinistea', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/854.png', 'This Pokémon is said to have been born when a lonely spirit possessed a cold, leftover cup of tea.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(855, 'polteageist', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/855.png', 'This species lives in antique teapots. Most pots are forgeries, but on rare occasions, an authentic work is found.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(856, 'hatenna', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/856.png', 'Via the protrusion on its head, it senses other creatures’ emotions. If you don’t have a calm disposition, it will never warm up to you.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(857, 'hattrem', 'psychic', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/857.png', 'No matter who you are, if you bring strong emotions near this Pokémon, it will silence you violently.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(858, 'hatterene', 'psychic', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/858.png', 'It emits psychic power strong enough to cause headaches as a deterrent to the approach of others.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(859, 'impidimp', 'dark', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/859.png', 'Through its nose, it sucks in the emanations produced by people and Pokémon when they feel annoyed. It thrives off this negative energy.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(860, 'morgrem', 'dark', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/860.png', 'When it gets down on all fours as if to beg for forgiveness, it’s trying to lure opponents in so that it can stab them with its spear-like hair.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(861, 'grimmsnarl', 'dark', 'fairy', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/861.png', 'With the hair wrapped around its body helping to enhance its muscles, this Pokémon can overwhelm even Machamp.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(862, 'obstagoon', 'dark', 'normal', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/862.png', 'Its voice is staggering in volume. Obstagoon has a tendency to take on a threatening posture and shout—this move is known as Obstruct.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(863, 'perrserker', 'steel', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/863.png', 'What appears to be an iron helmet is actually hardened hair. This Pokémon lives for the thrill of battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(864, 'cursola', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/864.png', 'Its shell is overflowing with its heightened otherworldly energy. The ectoplasm serves as protection for this Pokémon’s core spirit.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(865, 'sirfetchd', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/865.png', 'Only Farfetch’d that have survived many battles can attain this evolution. When this Pokémon’s leek withers, it will retire from combat.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(866, 'mr-rime', 'ice', 'psychic', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/866.png', 'It’s highly skilled at tap-dancing. It waves its cane of ice in time with its graceful movements.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(867, 'runerigus', 'ground', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/867.png', 'A powerful curse was woven into an ancient painting. After absorbing the spirit of a Yamask, the painting began to move.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(868, 'milcery', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/868.png', 'This Pokémon was born from sweet-smelling particles in the air. Its body is made of cream.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(869, 'alcremie', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/869.png', 'When it trusts a Trainer, it will treat them to berries it’s decorated with cream.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(870, 'falinks', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/870.png', 'Five of them are troopers, and one is the brass. The brass’s orders are absolute.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(871, 'pincurchin', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/871.png', 'It feeds on seaweed, using its teeth to scrape it off rocks. Electric current flows from the tips of its spines.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(872, 'snom', 'ice', 'bug', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/872.png', 'It spits out thread imbued with a frigid sort of energy and uses it to tie its body to branches, disguising itself as an icicle while it sleeps.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(873, 'frosmoth', 'ice', 'bug', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/873.png', 'Icy scales fall from its wings like snow as it flies over fields and mountains. The temperature of its wings is less than −290 degrees Fahrenheit.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(874, 'stonjourner', 'rock', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/874.png', 'It stands in grasslands, watching the sun’s descent from zenith to horizon. This Pokémon has a talent for delivering dynamic kicks.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(875, 'eiscue', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/875.png', 'It drifted in on the flow of ocean waters from a frigid place. It keeps its head iced constantly to make sure it stays nice and cold.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(876, 'indeedee', 'psychic', 'normal', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/876.png', 'It uses the horns on its head to sense the emotions of others. Males will act as valets for those they serve, looking after their every need.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(877, 'morpeko', 'electric', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/877.png', 'As it eats the seeds stored up in its pocket-like pouches, this Pokémon is not just satisfying its constant hunger. It’s also generating electricity.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(878, 'cufant', 'steel', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/878.png', 'It digs up the ground with its trunk. It’s also very strong, being able to carry loads of over five tons without any problem at all.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(879, 'copperajah', 'steel', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/879.png', 'They came over from another region long ago and worked together with humans. Their green skin is resistant to water.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(880, 'dracozolt', 'electric', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/880.png', 'In ancient times, it was unbeatable thanks to its powerful lower body, but it went extinct anyway after it depleted all its plant-based food sources.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(881, 'arctozolt', 'electric', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/881.png', 'The shaking of its freezing upper half is what generates its electricity. It has a hard time walking around.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(882, 'dracovish', 'water', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/882.png', 'Powerful legs and jaws made it the apex predator of its time. Its own overhunting of its prey was what drove it to extinction.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(883, 'arctovish', 'water', 'ice', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/883.png', 'Though it’s able to capture prey by freezing its surroundings, it has trouble eating the prey afterward because its mouth is on top of its head.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(884, 'duraludon', 'steel', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/884.png', 'Its body resembles polished metal, and it’s both lightweight and strong. The only drawback is that it rusts easily.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(885, 'dreepy', 'dragon', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/885.png', 'After being reborn as a ghost Pokémon, Dreepy wanders the areas it used to inhabit back when it was alive in prehistoric seas.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(886, 'drakloak', 'dragon', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/886.png', 'It’s capable of flying faster than 120 mph. It battles alongside Dreepy and dotes on them until they successfully evolve.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(887, 'dragapult', 'dragon', 'ghost', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/887.png', 'When it isn’t battling, it keeps Dreepy in the holes on its horns. Once a fight starts, it launches the Dreepy like supersonic missiles.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(888, 'zacian', 'fairy', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/888.png', 'Known as a legendary hero, this Pokémon absorbs metal particles, transforming them into a weapon it uses to battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(889, 'zamazenta', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/889.png', 'In times past, it worked together with a king of the people to save the Galar region. It absorbs metal that it then uses in battle.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(890, 'eternatus', 'poison', 'dragon', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/890.png', 'The core on its chest absorbs energy emanating from the lands of the Galar region. This energy is what allows Eternatus to stay active.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(891, 'kubfu', 'fighting', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/891.png', 'Kubfu trains hard to perfect its moves. The moves it masters will determine which form it takes when it evolves.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(892, 'urshifu', 'fighting', 'dark', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/892.png', 'This form of Urshifu is a strong believer in the one-hit KO. Its strategy is to leap in close to foes and land a devastating blow with a hardened fist.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(893, 'zarude', 'dark', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/893.png', 'Within dense forests, this Pokémon lives in a pack with others of its kind. It’s incredibly aggressive, and the other Pokémon of the forest fear it.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(894, 'regieleki', 'electric', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/894.png', 'This Pokémon is a cluster of electrical energy. It’s said that removing the rings on Regieleki’s body will unleash the Pokémon’s latent power.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(895, 'regidrago', 'dragon', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/895.png', 'An academic theory proposes that Regidrago’s arms were once the head of an ancient dragon Pokémon. The theory remains unproven.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(896, 'glastrier', 'ice', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/896.png', 'Glastrier emits intense cold from its hooves. It’s also a belligerent Pokémon—anything it wants, it takes by force.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(897, 'spectrier', 'ghost', NULL, 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/897.png', 'It probes its surroundings with all its senses save one—it doesn’t use its sense of sight. Spectrier’s kicks are said to separate soul from body.');
INSERT INTO pokemons.pokemon (id, name, type1, type2, pictureUrl, description) VALUES(898, 'calyrex', 'psychic', 'grass', 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/898.png', 'Calyrex is a merciful Pokémon, capable of providing healing and blessings. It reigned over the Galar region in times of yore.');
